INSERT INTO `Article` VALUES (19,'南岭杏花节','2023-04-16','活动','何佳悦 邢浩泽 赵天培 周昊燃 杨好 宫硕 龚博文 李海齐 吴子豪 陈力进 孙健皓 穆子圣 章紫嫣 何晨曦 龙腾','南岭杏花节活动总结\n                                负责人:何佳悦\n一、准备阶段(时间4月8日-4月15日）\n1. 4月8日晚:组长刘佳奇学姐分配任务，确定分工，由何佳悦同学负责排班，由于杏花节时间尚未确定，故排班三次\n2.4月11晚安排第一次彩排(4月12日早8:50），组建机器人分队QQ群，联系通信工程学院杏花节负责老师，3名s1负责机器人同学进行彩排，确定花车巡游大概流程。\n4月11日联系文学院负责人，组织策划活动，由文学院出诗句，何佳悦打印及打印标签。\n3.4月12日统计花车巡游负责同学空闲时间，确定4月13日2:30-4:30，19:00－20:30在创客空间进行排练(包括如何操作，调试，排队形)\n4.4月14日找2名负责s1机器人进行调试，自行制作靶子(背景应用吉甲元素及文学院元素），安排安琪打印社制作。\n5.与玄老师沟通，可将老英雄，药盒奖状运到南岭校区，借吉甲队服在花车巡游时穿。\n二、百团纳新(4月15日)\n1.  4月14日与老师沟通在前卫的百团纳新中增设老英雄机器人，安排南区两名同学于4月15日早10点进行搬运\n2.安排百团纳新早7点，何佳悦、龚博文和李海齐将南岭4辆s1机器人，10个靶子，7个小矿石，3000张宣传单带到南卫校区，组织同学现场实操机器人，获得手环，介绍吉甲大师梦工场社团，并及时将电池充电。并于11:30将上述南岭物资带回南岭校区\n三、物资运输\n1.4月13日中午杨好，章紫嫣负责通过货拉拉将ai机器人运到创客空间\n2.4月15日早7点半何佳悦、龚博文和李海齐将南岭4辆s1机器人，10个靶子，7个小矿石，3000张宣传单带到南卫校区，\n3.4月15日晚17点赵天培，邢浩泽乘货拉拉将老英雄机器人运到创客空间\n4.4月15日晚杨好，何佳悦，吴子豪，宫硕到南湖校区，何佳悦，吴子豪，宫硕将4件队服，奖状，奖杯，显微镜，两块s1电池,1个充电器(已做好登记），1块ai车电池运到创客空间\n5.4月16日早9:00何厚良学长负责将药瓶，4个借好的小推车(何佳悦联系通信工程学院杏花节负责的老师借的)通过货拉拉运输到南岭校区\n6.4月16日下午15:30何厚良学长负责将药瓶，ai车，4个小推车，显微镜(被子没带)通过货拉拉运输到南湖校区\n7.4月16日下午17:00何佳悦负责将物资统计，将杨好等4名南湖同学将5个s1机器人，7块电池，5个充电器(何晨曦的没找到)，4件队服(何晨曦4月17日自行送到南湖），5个奖状，1个奖牌，被子，1个大电池\n补充:何晨曦已于4月17日将队服，2瓶水晶弹，10个靶子送到南湖校区\n四、杏花节(4月16日)\n1.早7点安排6名同学到帐篷集合搬桌椅\n2.8:00－9:30运输物资，9:30花着巡游同学就位，10:30花车巡游结束，到达帐篷组织游戏，两名同学接受电视台等采访\n3.11:55－12:10舞台展示5个s1机器人上场，何佳悦主持活动\n4.12:10－16:30组织同学操作机器人\n5.16:30－18:00整理安排运输物资\n五、人员分配\n1. 总负责人：何佳悦\n2. S1机器人：邢浩泽，赵天培，龚博文，李海齐，何晨曦\n3. 工程车：吴子豪、宫硕\n4. 展台、协同组织游戏活动：周昊燃、陈力进、孙健皓、穆子圣\n六、活动出现问题及注意事项\n1.按时到场，安排好时间，不要迟到(1名同学迟到2个半小时，一直打电话不接)\n2.物资统一放到创客空间(比如s1机器人，充电器，电池等)\n3.统一听从管理(1名同学未经同意把创客4个奖状于早上8点拿到帐篷处)\n4.管理，准备好自己负责的物资，不要丢东西(1名同学充电器未找到，提前泡好水晶弹等)\n5.保持通讯畅通(如:打多次电话不接，联系不上)\n6.尽量合理分配人员，时间(此次见下图)，\n  可以分为上下午两场，人员平均分配，最好不要出现很多人待一天的情况\n7.在摊位上的同学尽量更多的向同学们介绍社团，及纳新相关的问题(①有的同学拿着一摞宣传单，到最后也没发出去，②要积极主动，不要让路过的同学问到才发传单③尽量站在人流量多的地方，不要站在树林拿着传单)\n','[{\"name\":\"83741112_582256a667c2fe201f616a090b3d2d57_1681995927313.jpg\",\"url\":\"http://tarsgo.oss-cn-chengdu.aliyuncs.com/TARSGO/Articles/2023-04-17/%E4%BD%95%E4%BD%B3%E6%82%A6/83741112_582256a667c2fe201f616a090b3d2d57_1681995927313.jpg\",\"uid\":1681995930077,\"status\":\"success\"},{\"name\":\"93275375_371361ee5e1768b6dfea726a75d5361f_1681997166390.jpg\",\"url\":\"http://tarsgo.oss-cn-chengdu.aliyuncs.com/TARSGO/Articles/2023-04-17/%E4%BD%95%E4%BD%B3%E6%82%A6%20%E9%82%A2%E6%B5%A9%E6%B3%BD%20%E8%B5%B5%E5%A4%A9%E5%9F%B9%20%E5%91%A8%E6%98%8A%E7%87%83%20%E6%9D%A8%E5%A5%BD%20%E5%AE%AB%E7%A1%95%20%E9%BE%9A%E5%8D%9A%E6%96%87%20%E6%9D%8E%E6%B5%B7%E9%BD%90%20%E5%90%B4%E5%AD%90%E8%B1%AA%20%E9%99%88%E5%8A%9B%E8%BF%9B%20%E5%AD%99%E5%81%A5%E7%9A%93%20%E7%A9%86%E5%AD%90%E5%9C%A3%20%E7%AB%A0%E7%B4%AB%E5%AB%A3%20%E4%BD%95%E6%99%A8%E6%9B%A6/93275375_371361ee5e1768b6dfea726a75d5361f_1681997166390.jpg\",\"uid\":1681997167260,\"status\":\"success\"},{\"name\":\"69450565_582256a667c2fe201f616a090b3d2d57_1681997189399.jpg\",\"url\":\"http://tarsgo.oss-cn-chengdu.aliyuncs.com/TARSGO/Articles/2023-04-17/%E4%BD%95%E4%BD%B3%E6%82%A6%20%E9%82%A2%E6%B5%A9%E6%B3%BD%20%E8%B5%B5%E5%A4%A9%E5%9F%B9%20%E5%91%A8%E6%98%8A%E7%87%83%20%E6%9D%A8%E5%A5%BD%20%E5%AE%AB%E7%A1%95%20%E9%BE%9A%E5%8D%9A%E6%96%87%20%E6%9D%8E%E6%B5%B7%E9%BD%90%20%E5%90%B4%E5%AD%90%E8%B1%AA%20%E9%99%88%E5%8A%9B%E8%BF%9B%20%E5%AD%99%E5%81%A5%E7%9A%93%20%E7%A9%86%E5%AD%90%E5%9C%A3%20%E7%AB%A0%E7%B4%AB%E5%AB%A3%20%E4%BD%95%E6%99%A8%E6%9B%A6/69450565_582256a667c2fe201f616a090b3d2d57_1681997189399.jpg\",\"uid\":1681997189947,\"status\":\"success\"},{\"name\":\"33259765_e017cc57c61c29baa664e18fe8a14902_1681997384661.jpg\",\"url\":\"http://tarsgo.oss-cn-chengdu.aliyuncs.com/TARSGO/Articles/2023-04-17/%E4%BD%95%E4%BD%B3%E6%82%A6%20%E9%82%A2%E6%B5%A9%E6%B3%BD%20%E8%B5%B5%E5%A4%A9%E5%9F%B9%20%E5%91%A8%E6%98%8A%E7%87%83%20%E6%9D%A8%E5%A5%BD%20%E5%AE%AB%E7%A1%95%20%E9%BE%9A%E5%8D%9A%E6%96%87%20%E6%9D%8E%E6%B5%B7%E9%BD%90%20%E5%90%B4%E5%AD%90%E8%B1%AA%20%E9%99%88%E5%8A%9B%E8%BF%9B%20%E5%AD%99%E5%81%A5%E7%9A%93%20%E7%A9%86%E5%AD%90%E5%9C%A3%20%E7%AB%A0%E7%B4%AB%