DROP TABLE IF EXISTS `Financial_Log`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `Financial_Log` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '名称',
  `model` varchar(255) DEFAULT NULL COMMENT '型号',
  `quantity` int(11) NOT NULL DEFAULT '0' COMMENT '数量',
  `unit` varchar(255) DEFAULT '个' COMMENT '单位',
  `price` float NOT NULL DEFAULT '0' COMMENT '单价',
  `extra_price` float NOT NULL DEFAULT '0' COMMENT '运费',
  `purchase_link` longtext COMMENT '购买链接',
  `post_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '时间',
  `purchaser` varchar(255) NOT NULL COMMENT '采购人',
  `phone` varchar(255) DEFAULT NULL COMMENT '联系方式',
  `campus` varchar(255) DEFAULT NULL COMMENT '校区',
  `usage_description` longtext COMMENT '用途',
  `group_name` varchar(255) DEFAULT NULL COMMENT '技术组',
  `troop_type` varchar(255) DEFAULT NULL COMMENT '兵种',
  `project` varchar(255) DEFAULT NULL COMMENT '项目',
  `remarks` longtext COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=2349 DEFAULT CHARSET=utf8mb4;
/*!40101 SET character_set_client = @saved_cs_client */;

