--
-- Table structure for table `Material_Log`
--

DROP TABLE IF EXISTS `Material_Log`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `Material_Log` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `item_name` varchar(255) NOT NULL COMMENT '物资名称',
  `category` int(11) NOT NULL DEFAULT '0' COMMENT '物资类别',
  `operator` varchar(255) NOT NULL COMMENT '操作者',
  `operation_type` int(11) NOT NULL DEFAULT '0' COMMENT '操作类型',
  `operation_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '操作日期',
  `site` int(11) NOT NULL DEFAULT '0' COMMENT '所在位置',
  `quantity` int(11) NOT NULL DEFAULT '0' COMMENT '物资数量',
  `quantity_unit` varchar(255) NOT NULL DEFAULT '个' COMMENT '数量单位',
  `purpose` int(11) NOT NULL DEFAULT '0' COMMENT '物资用途',
  `usage_description` longtext COMMENT '物资使用简述',
  `approver` varchar(255) NOT NULL COMMENT '审批人',
  PRIMARY KEY (`ID`),
  KEY `Material_Log_Material_Category_ID_fk` (`category`),
  KEY `Material_Log_Material_Usage_ID_fk` (`purpose`),
  KEY `Material_Log_Material_site_ID_fk` (`site`),
  CONSTRAINT `Material_Log_Material_Category_ID_fk` FOREIGN KEY (`category`) REFERENCES `Material_Category` (`ID`),
  CONSTRAINT `Material_Log_Material_Usage_ID_fk` FOREIGN KEY (`purpose`) REFERENCES `Material_Usage` (`ID`),
  CONSTRAINT `Material_Log_Material_site_ID_fk` FOREIGN KEY (`site`) REFERENCES `Material_site` (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=183 DEFAULT CHARSET=utf8mb4;
/*!40101 SET character_set_client = @saved_cs_client */;

