--
-- Table structure for table `Material_Outbound`
--

DROP TABLE IF EXISTS `Material_Outbound`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `Material_Outbound` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `item_name` varchar(255) NOT NULL COMMENT '物资名称',
  `category` int(11) NOT NULL DEFAULT '0' COMMENT '物资类别',
  `outbound_personnel` varchar(255) NOT NULL COMMENT '出库人',
  `quantity` int(11) NOT NULL COMMENT '物资数量',
  `quantity_unit` varchar(255) NOT NULL DEFAULT '个' COMMENT '数量单位',
  `site` int(11) NOT NULL DEFAULT '0' COMMENT '所在位置',
  `purpose` int(11) NOT NULL DEFAULT '0' COMMENT '物资用途',
  `usage_description` longtext COMMENT '物资使用简述',
  `outbound_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '出库日期',
  `flag` int(11) NOT NULL DEFAULT '0' COMMENT '审批状态',
  `approver` varchar(255) DEFAULT NULL COMMENT '审批人',
  PRIMARY KEY (`ID`),
