INSERT INTO `SignUpData` VALUES (1,'李香怡','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726968347594_3674915940.jpg','女','江苏省丰县','南湖校区','2024','通信工程学院','通信工程','20241907','2941925465','15714940532','m15714940532@163.com','视觉组',1,'运营组',1,'我是李香怡，来自新疆阿克苏。是一个性格外向，永远不缺乏向上生命力的女孩子，一般精力都比较充沛。在平常我喜欢看些书，多是理论逻辑类的，比如刘润的底层逻辑，认知天性，被讨厌的勇气等，也看稍涉猎文学，比较喜欢的是张爱玲和李娟的作品。','我来参加吉甲大师。一是希望可以能够贡献自己的一份价值，让自己的青春多彩一点。二是为了提高自己的专业能力，把自己学的知识学以致用。另外也是想要继续提升自己个人的沟通能力，组织能力，策划能力等，继续精进自我。','首先我是希望可以我的专业知识奉献一些让吉甲越来越好，其次我希望可以有机会交到志同道合的好友一起度过大学四年。最后我希望可以提高自己各种通识能力。','首先吉甲大师是一个极好的能培养学生综合能力的大型平台。它在2018.12建立，是个双创实建基地，目前在南湖南岭中心校区均有发展。内容涉及文理工，综合性极强。\n吉甲大师社团是一个学习氛围浓厚的圈子。一说选拔制度，经过层层选拔留下的人都会有所共通性，能有热爱吉甲，在事物上精益求精做到极致，认真负责，专心致志的精神，这让一群有共同梦想，有团队神的人聚在了一起。二说吉甲负责项目，吉甲负责Robomaster以及其他竞赛项目，会设计出产业所需的产品，这意味着学生将有更多机会经历项目式培养，能更好的锻炼自身综合能力。'),(2,'蔚锦鹏','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1725107636364_2482561500.jpg','男','山西','南湖校区','2024','通信工程学院','信息工程','20240811','529221211','19112924388','529221211@qq.com','电控组',1,'机械组',2,'我来自2024级通信工程学院8班的蔚锦鹏，想在大学期间有所作为，参加科学创新活动，多多磨练自我。','比较对这种类似MOBA塔防感兴趣','期待自己能变得张扬开放，对C语言有所了解。','是一个很好的研制机器车并且培养团队意识整体意识的平台。\n'),(3,'朱若帆','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1725107677836_0491180955.jpg','女','河南省商丘市','南岭校区','2024','通信工程学院','机器人工程','20240404','1355520538','18903701458','1355520538@qq.com','运营组',1,'视觉组',1,'我是24级，机器人专业04班的朱若帆，我性格外向，交流能力强，有执行力。','对机甲感兴趣，也有一定的了解。希望能加入咱们社团，提升兴趣爱好与获得经验。','期待在社团生活中，提高能力，增长见识。希望能够参与一些比赛，获得成绩。','了解较少，只看过其它大赛纪录片，希望能在吉甲大师进一步了解。'),(5,'冷庆航','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1725109602721_4025863786.jpg','男','江苏','南岭校区','2024','通信工程学院','自动化','20240121','2247114088','18344827070','2247114088@qq.com','软件组',0,'电控组',1,'学长好 我是大一自动化的新生。第一志愿选择了软件组是因为我高中学过一点点信息竞赛 拿了一个省二 所以c++有一些基础 而且认识的一个学长也在软件组 他向我大力推荐。第二志愿选择电控组是因为我的专业是自动化 但是现在还没有开始上专业课 对此了解也不多 数电模电好像我们都要学 对于电控组来说应该合适一些（？','高中的时候就听说过robomaster这个比赛 当时就觉得挺有意思的 没想到来到了吉大之后发现真的有这个社团！所以看到社团招新之后就马上报名了 希望可以加入吉甲大师！','希望学到一些有用的知识 \n迎接新的挑战 锻炼自己的抗压与团队合作能力 \n希望结识优秀的学长学姐们并向他们学习 结识更多志同道合的伙伴','对吉甲大师的了解其实不是很多 仅限于有认识的软件组的学长跟我讲了一些社团趣事（？'),(6,'张宇航','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727183445177_2434214313.jpg','男','黑龙江省肇州县','前卫南区','2024','仪器科学与电气学院','电气工程及其自动化','65240116','3199014470','15164531678','zyh15164531678@163.com','电控组',1,'AI组',0,'小镇不做题家，尽管对项目所需知识无基础但是正努力学习，已熟读吉甲大师入队基础知识；谦虚好学（不懂就问）；情绪稳定善于与人沟通；掌握计算机基础操作；动手能力较强；对吉甲大师感兴趣愿意付出精力学习知识并实践。','学习内容与个人专业素养提升和职业发展方向高度一致，加入团队可以认识许多学识渊博的同学大佬，对吉甲大师项目非常感兴趣（没人可以拒绝造机器人）','学会一点就是赚到，拓宽视野为将来职业发展做准备；\n接触很酷的机器人项目；和志同道合的同学朋友交流。\n目标就是尽我所能，多学多看。','已观看完群消息中了解战队视频大全和新人入队基础知识；了解机甲大师比赛规则和吉甲大师成绩；知晓进组后学习内容路线和规划。'),(7,'徐昕遥','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726920816917_0205613105.jpg','男','吉林省通化市','南湖校区','2024','通信工程学院','通信工程','20241327','2445962063','17319347037','2445962093@qq.com','电控组',1,'视觉组',1,'2024级通信工程小登。','热爱吉甲大师，希望通过实践得到自我提升。','在实践中提升自己的技能，为TARS－GO战队贡献自己的智慧和创意。','吉甲大师是吉林大学的机甲团队。跨专业组成，有机械、电控等小组。会搞校内赛，也参加全国大赛。能设计多种机器人，涉及好多技术。以学生为主，老师辅助。培养学生能力，提供实践平台，超有意义。'),(8,'邬培民','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726832637750_6226168781.jpg','男','广东省汕尾市','南岭校区','2024','通信工程学院','机器人工程','20240422','2166363684','18929729101','2166363684@qq.com','机械组',1,'电控组',0,'我是南岭校区通信工程学院机器人工程2024级新生，具有一定材料与电路的制造基础，不怕苦不怕累，顶顶的','从小痴迷于机甲浪漫，想要通过自己与队友的一起努力，打造一台属于自己的帅气机甲，并在赛场上大放异彩！！','一定是要学会设计制造的本领，与同学团结协作的能力，造出超强机器人踏平RM赛场！！','吉甲大师是一个有组织有效率，充满激情，给同学提供发展与成长的社团'),(9,'刘力齐','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1725170726807_4210933075.jpg','女','湖南','南湖校区','2024','通信工程学院','通信工程','20241707','3268901961','18889892563','3268901961@qq.com','运营组',1,'AI组',1,'大家好，我是通信工程2024级17班的刘力齐，我来自海南海口。我报名面试的岗位是运营组的宣传部门。我平日里的爱好有摄影和登山、骑行等户外运动，喜欢用相机记录下每一个珍贵的瞬间。我很高兴能够站在这里和大家相见。如果有幸进入吉甲大师这个优秀的社团，我会积极的配合各位的工作，为社团建设贡献出自己的一份力量。','在大四学长学姐的介绍下，我了解到了吉甲大师这个社团。小时候我便对机器人这类智能化、敏锐化的事物感兴趣。但我自认为在机器人制作这一方面的专业知识上我的能力有所欠缺，尽管如此，我还是想加入吉甲大师这个优秀的社团，近距离的接触到机器人以及机器人的制作这一过程。同时，加入吉甲大师，我还可以认识到与我同龄的出色的同学们，我们志同道合，共同为社团的发展建设做出努力，为我的大学生活增光添彩。','收获:能够精进ps技术，以及熟练的运营公众号，同时提高我的服务意识，更好的为同学们着想。\n目标：加入运营组，我希望能在学长学姐以及与我同龄的同学的帮助下，在微信公众号、B站等社交平台上积极宣传，提高RoboMaster赛事的知名度，让更多在校大学生们了解到这个令人热血沸腾的机器人大赛，同时对外展示TARS-Go战队的形象，提高社团在校内的影响力，让更多同学，以及未来的学弟学妹们加入吉甲大师。','吉甲大师是吉林大学校内由玄玉波老师带领的一支优秀社团，在RoboMaster机甲大师2024赛季对抗赛中获得了东部赛区八强的好成绩，首次冲进国赛。'),(10,'孙宏久','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1725372701322_0634327076.jpg','男','山东省淄博市','南岭校区','2024','通信工程','机器人工程','20240425','2636745733','15104304734','2636745733@qq.com','电控组',1,'运营组',1,'24级新生，机器人工程专业，愿意积极学习基本原理','希望对专业学习有帮助，学习到有用的相关技术，增长专业经验，喜欢机甲，希望探索','提升专业知识，增长见识和经验，基本了解机甲运行原理','基本为零，愿意从头学起'),(11,'周靖策','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1725374759760_7976417428.jpg','男','江苏省江阴市','南岭校区','2024','通信工程学院','机器人工程','20240413','1770795447','18623307761','1770795447@qq.com','运营组',1,'电控组',2,'愿意为团队付出，态度端正','比较喜欢这方面内容，希望学有所成','能得奖最好，不能得希望学到东西','感觉得过挺多奖的，挺牛逼的'),(13,'刘皓森','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727084447636_9624665957.jpg','男','湖北襄阳','南岭校区','2024','通信工程学院','空间信息与数字技术','20240607','2543838536','13042800043','2543838536@qq.com','电控组',1,'AI组',1,'已入面试笔试','已通过面试笔试','已通过面试笔试','已通过面试笔试'),(14,'吴俊辰','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726920720416_6441048832.jpg','男','河北邯郸','南岭校区','2024','通信工程学院','机器人工程','20240414','2130905821','15546599071','15546599071@163.com','电控组',1,'视觉组',1,'我是大一新生，来自机器人工程专业，虽然在计算机方面没有基础，但是非常想要参加吉甲大师','想要学习相关课程与知识提升自己','想要学到更多知识和课程，想要努力加入吉甲大师，争取进入国赛','是吉林大学的一个非常具有创新性非常有趣味的社团，大家一起努力学习努力研究进入全国大赛，大家都很具有创新精神'),(15,'杨家豪','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726834259541_6561287143.jpg','男','河北省邯郸市','南岭校区','2024','通信工程学院','机器人工程','20240416','2898414227','15103104164','2898414227@qq.com','视觉组',1,'机械组',2,'我叫杨家豪，喜欢数学，物流和计算机','希望可以学到很多知识和经验','希望真正能学会学习，并真正热爱吉甲','有基本的一些知识的了解'),(16,'阳锦鹏','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727018262118_1447184432.jpg','男','湖南株洲','前卫南区','2023','仪电','智能感知','24220809','1925329833','18975337029','1925329833@qq.com','电控组',1,'视觉组',1,'来自仪电学院，对电控很感兴趣，擅长数学，掌握一定的编程知识，如c语言，python，matlab等，具有责任心、不放弃的精神，有毅力。','希望在rm学到新知识，结交有相同兴趣的朋友，希望参加比赛打出好成绩','希望进入正选队，希望掌握新知识，目标是打入国赛','参加了宣讲会，团队合作，分为电控组，视觉组，软件组，ai组，机械组，运营组，2018年底开始创立，今年进入了国赛。'),(17,'王硕','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1725715944601_9312411439.jpg','女','吉林长春','前卫南区','2024','仪器科学与电气工程学院','仪器类','13230207','2636450198','15844076090','2636450158@qq.com','电控组',1,'运营组',1,'23级转专业到仪器，由于课多想好好学于是降转至24级，学习过电分基础课程，基本掌握C语言，参加过本学院的夏令营，EDA，CUBEIDE等软件可基本掌握，在25年有更多充裕时间，家在长春，平时及寒暑假培训可积极参加。','非常喜欢相关创作，希望多通过实践进一步提升专业能力，对贵项目组的文化很氛围很认可并期待参与其中。','如果加入电控组，希望可以成为正式队员多学习相关软件以及制造原理，多和大家交流结交志同道合的伙伴，合作参加比赛，续写吉大荣光；\n如果加入运营组，希望可以凭借在吉大大学生科创社团秘书部工作经验进一步成长，仔细了解各个部分的运行架构，多分析并学习相关经验。','通过几场比赛了解，很震撼，很喜欢这种灵活实际对战的收获与体验，团队配合能力出色，比赛规则大致了解，各种队别里的机器人在进一步了解，希望有机会现场学习深刻体验。'),(18,'王紫嫣','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1725793953506_9542141624.jpg','女','内蒙古自治区锡林郭勒盟','前卫南区','2024','考古学院','考古大类','38240202','1542252541','13384870324','1542252541@qq.com','运营组',1,'视觉组',1,'性格开朗外向，擅长社交\n责任心强，听调听宣，先天牛马圣体（bu）\n会用软件制图做美工，还会写文案\n但是纯文科女，技术力真没有（目移）','看起来很酷，入坑一下想近距离围观（你）\n宣传的学长太热情了硬是把我拉进纳新群（）','希望能锻炼自己的工作能力，为社团做出贡献，让大学生活多一抹色彩','我可以学（心虚）'),(20,'任泽宇','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726831322679_5856732262.jpeg','男','河北省石家庄市','南岭校区','2024','交通学院','交通运输类','17240619','2047118730','18931163780','2047118730@qq.com','视觉组',2,'软件组',1,'24新生','喜欢机器人','在比赛中提升自己','吉甲大师是一款由吉林大学自主研发的开放世界机器人社团'),(21,'田正源','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726831356734_9516606924.jpg','男','辽宁省大连市','南岭校区','2024','材料科学与工程学院','材料类','16240807','2604615780','13109832641','13109832641@163.com','电控组',1,'机械组',1,'学过C#但好像没啥用\n接触过单片机','想为手搓机娘打下基础','学会硬件设计与基础编程','新兴之星\n由一群嘻嘻哈哈但有实力的学长学姐组成'),(22,'杨子昂','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726831357144_0845055367.jpg','男','安徽','南岭校区','2024','交通','交通运输类','17240313','3299063946','18154116638','3299063946@qq.com','AI组',1,'运营组',1,'参与过安徽的高中机甲大师项目，比较感兴趣。','大学机甲大师和高中天差地别，编程门槛更高了，几乎是小白，想见见世面','收获赛事和实践经验','有一定实力和规模的团队，培养体系很健全'),(23,'柳畅','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726831689015_6772323449.jpeg','男','河南省商丘市','南岭校区','2024','机械与航空航天工程学院','机械工程','14241314','1799486525','19836505968','1799486525@qq.com','机械组',1,'AI组',2,'有热爱，有信心，可塑性强的一个小白','对机器人很感兴趣','掌握一些技能，为未来发展奠基','了解了新人必知和多个视频，很感兴趣'),(24,'何啸雲','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726832143083_3512116277.mp4','男','安徽省六安市','南岭校区','2024','通信工程学院','机器人工程','20240409','1693945142','18164391009','hdszqm520@163.com','电控组',1,'软件组',0,'我是通信工程学院机器人工程的学生，我个人对计算机程序以及数学十分感兴趣，拥有责任心，善于学习，勤奋务实，刻苦钻研。我有信心通过学习达到rm的技术要求，并且进一步发展。','首先基于我对计算机和数学的兴趣，我希望加入rm能够拓展我的视野，并且提高自己的个人能力。我对rm也十分有兴趣，可以结交朋友，也能够丰富经验。','我希望自己能够具备足够的计算机和语言程序的知识，将来有能力进入大企业工作。','吉林大学TARS-GO战队成立于2018年底，当时她在广州开会了解到国内有此项运动的比赛，回校后发现有一些同学对机甲充满兴趣，于是一拍即合，开启了向未知的探索之旅，不断向机甲大师的殿堂迈进。'),(25,'徐哲','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726832169577_7053379987.jpg','男','浙江宁波','南岭校区','2024','汽车工程学院','车辆工程','15240311','3361262872','18758484394','3361262872@qq.com','视觉组',1,'机械组',1,'自学过一点点机械设计，Python，c++（学无止境）\n数学物理还可以拿过一些奖\n家里面是做机电的能提供不少帮助','为了学真本事，练真技术\n顺便打爆我的死党——某浙江211的机甲社团的高中同学','拿一些奖来丰富自己的简历\n拥有难忘的回忆和友情\n通过努力让吉甲大师更上一层楼','高中时看过一些比赛，感觉很热血，但是深入了解的机会就指望社团能不能给个机会ฅ՞•ﻌ•՞ฅ'),(26,'李思远','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726831332734_4183772193.jpg','男','河南省淮阳县','南岭校区','2024','通信工程学院','机器人工程','20240420','1181566534','19929197488','lsydemail@qq.com','机械组',2,'电控组',1,'我来自2024级通信工程学院机器人工程，曾在初中阶段接触过机器人比赛，对吉甲大师十分感兴趣，虽然可以说是零基础，但我实实在在对机器人神往（高中三年只得被迫为学业奋斗，无缘机器人比赛），我自认为学习能力比较强，能较快适应新的知识和技术，也希望借此锻炼自己，培养能力。','与志同道合的人相识，学习新的专业知识，参加比赛，接受新的挑战，丰富人生阅历','希望能成为正选队员，打比赛，获得奖项，和团队一起去其他地方','是一群未来综合工程师在一起交流比拼，合作学习的平台，和战友们共同进步，一起哭，一起笑的舞台'),(28,'杨红栋','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726834177178_1162903591.jpeg','男','河南省浚县','南岭校区','2024','材料科学与工程','材料','16241022','2644986732','17539221598','2644986732@qq.com','机械组',1,'电控组',0,'您好，我是材料类新生，对机械，建模有兴趣，希望能与大家共事','对机器人有兴趣，也希望借此提升自己的能力','能够将自己喜欢的模型带到现实，提升自己的能力','主要打RM的一个能促进学生能力提升的社团，可以给学生们一个相互合作，共同成长，为校争光的平台'),(30,'王鸿泽','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726833528220_4787883482.jpg','男','吉林省公主岭市','南岭校区','2024','机械与航空航天工程学院','机械工程','14240330','1840909332','18043574159','1840909332@qq.com','机械组',1,'电控组',0,'学长好我是机械工程专业的王鸿泽，我之前学习过Arduino和一点c++，然后有过焊接学习的经历，学习过单片机编程，编写过遥控车程序，焊接过收音机，电子闹钟，并且自己编写闹钟程序，进行调试，参与过比赛的rescue项目，随队学习过一段时间vex','在进入吉大之前就了解过，看过有关吉大的比赛，从小就很喜欢机器人和编程这一类，喜欢动手，喜欢自己进行组装，也喜欢打比赛，所以很希望能加入这个大家庭，也希望能出去了解更多，能够吃苦耐劳，也能巩固自己的专业知识能做出更多更好的贡献','希望能够在团队合作当中巩固集体凝聚力，收获一群志同道合的朋友，能够更好的运用专业知识，有更多的实践经验，并且帮助队伍获得更好的成绩，为了学校和社团，队伍的荣誉奋斗','吉甲大师从创立开始就由机器人爱好者组成，大家为爱发电，将自己的知识运用于实践，在今年冲进国赛也是创造了历史，五年一剑，尽展锋芒，当时2020年的时候虽然仅第一次出征但是就取得了一等奖'),(31,'邓凯之','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726833733457_9702098358.jpg','男','江西赣州','南岭校区','2024','机械与航空航天工程学院','机械工程','14240206','2417246540','19729378090','dkzminecraft@163.com','机械组',1,'AI组',1,'我来自江西赣州，从小我就热爱发明创造，后来，我对机械制造与人工智能产生了浓厚的兴趣，所以我报考了吉林大学的强势专业机械工程，希望能在这里学习到真正的科学技术，掌握高科技的力量，让科技造福人类，让科技改变世界！','我对机械制造与人工智能有着浓厚的兴趣，有一天我发现了吉甲大师，面对这些高科技机器人时，我体会到强大科技的力量带来的冲击，感觉自己也许能在这里找到方向，离自己的梦想更近一步。','希望在吉甲大师学习到智能机器人制造相关的专业知识与技术，研发更强大的机器人。同事，积累社交经验，加强合作能力，为以后的工作打好基础。','吉甲大师是一个专业且完整的团队，涉及多方面的合作，包含软件与硬件的研发，人工智能的实战应用，管理与运营，功能齐全，分工明确，是不可多得的事业型社团。吉甲大师的成员专业且责任心强，技术组结构完整且高效，战队实力强劲，运营细致耐心。在这里，我们可以找到激情拼搏的战场，在这里，我们也可以享受科研带来的成就感。'),(32,'姜琳淞','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726834977572_7841012454.jpg','男','山东省','南岭校区','2024','材料科学与工程学院','材料类','16240620','3783995134','19854219838','3783995134@qq.com','机械组',1,'运营组',1,'一颗热爱之心，愿意加入机甲大师并为之努力','感兴趣','有一门兴趣爱好，过得一项技能，','设计，组装，遥控机器人并完成任务'),(33,'刘锦腾','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726834694991_4834892334.jpg','男','黑龙江省齐齐哈尔市','南岭校区','2023','生物与农业工程学院','农业机械及其自动化','82230236','3642192804','18745736293','3642192804@qq.com','机械组',1,'电控组',0,'大一在原专业担任班长，具备一定的组织能力，工作认真负责，对robomaster抱有浓厚的兴趣，具有一定的solidworks基础，做出了一些可以实际应用的物品并投入使用，擅长摄影视频剪辑，在吉林大学官方微信号运营团队担任视频部部长一职，有需要也可以为运营组贡献力量','对robomaster抱有兴趣。第一次接触是上学期偶然的一次推送制作，看到了吉大对战西工大的比赛，感觉这个东西可太有意思了，如果自己也能加入，做出些成果，我感觉会很有成就感。','希望能够进入这个团队，成为正式队员，为比赛贡献自己的一份力','了解不多 嘿嘿'),(34,'陈渊铭','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726835727850_2368207971.jpg','男','安徽省安庆市','南岭校区','2024','材料科学与工程学院','材料类','16240816','597443858','18855679677','597443858@qq.com','机械组',1,'电控组',0,'我的专业是材料类，喜欢机械和机器人','机器人深深吸引着我，同时我也很想参加RM竞赛','一方面我希望在团队中提升自身能力，另一方面我想和志同道合的朋友们友团结协作，最终在RM竞赛中取得优异成绩','吉甲大师不仅仅是一个社团，更是一个战队，聚集着一群热爱机器人、敢拼敢为的有识之士。在这里所有人都为共同的理想'),(35,'代银龙','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726835707297_1400411735.jpg','男','汉','南岭校区','2024','机械与航空航天学院','机械工程','14240116','2108941960','18348487188','2108941960@qq.com','机械组',1,'AI组',2,'学长学姐好，我叫代银龙，来自河南信阳。哥哥大学学习的是机械设计及其自动化，我也想试试。自己其实不知道自己喜欢什么，但看了机甲大师比赛的视频还是热血沸腾，想亲身参与到这场比赛。','想要学习机械专业的实践经验，也想去深入了解咋吉甲大师，去在吉甲大师留下自己的青春记忆（从小到大是在没参加过啥）','期待在吉甲大师收获机械学习的经验，结识志同道合的伙伴，留下自己的痕迹','志同道合之人的聚集地，真心热爱之人的出发点'),(36,'韩鹏远','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726835959161_5105727621.jpg','男','吉林省','南岭校区','2024','机械与航空航天工程学院','机械工程','14240722','3520813147','13843259416','3520813147qq.com','视觉组',1,'电控组',0,'一个享受研究的机械生，一个兴趣多样的普通人，一个做事认真的研究者，谨慎处事，平静做人。','希望能加入一个真正热爱的组织，一个能增长知识点组织，一个有抱负的组织。而吉甲大师符合我的所有预期，仅此而已……','学习自己想学到的，了解自己想了解的，做自己想做的事，成为自己想成为的人','一个吉大知名的组织，几十个有抱负的人，无数抚平星辰的夜，六个各司其职的部门，几十个元件组成，为了一个共同的梦，还有……星辰大海。'),(37,'韩政希','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726840551537_3559582048.jpg','男','四川省广元市苍溪县','南岭校区','2024','机械与航空航天工程学院','工程力学','14241110','3033696497','15983394372','3033696497@qq.com','机械组',1,'电控组',0,'我叫韩政希，在四川长大，是吉林大学24级机械学院力学系的本科生。是一个对电脑和机器人一窍不通的小白。','一开始知道机甲大师这一赛事是在高中阶段，偶然看到了比赛的视频，被炫酷的赛场震撼，但只是作为云观众看个输赢。直到通过吉甲大师了解到RMer这个团体，希望自己也能像前辈在这个平台中收获对团队合作的实践经验以及专业能力。更重要的是，想踏出自己的舒适区，加强自己的动手能力和对软件的理解和应用。','期望是希望自己在为团队努力的同时，收获对理论知识的实践经验，拥有一个充实的大学生活。更重要的是，希望能够收获一帮志同道合的挚友。目标是能够挺过选拔，能为团队尽自己的一份力，希望有资格代表吉大作为TARS-Go的一员在赛场上拼搏。','第一次了解吉甲大师是在宿舍楼下的宣传，它给我的映象仅限于热情的学长。第二次了解吉甲大师是在视频中，了解到在吉甲大师的前辈们的优秀成果和忘我的努力。直到到南湖校区实地参观才被现场的氛围感染，认为这是一个青年工程师结识同伴，追求卓越的梦想之地。后来了解到它与企业的合作，以及整个战队的运营，方才认识到这是一个非凡的集体，是一个理想化的“职场”，也是大佬云集的多学科交叉的知识风洞。'),(38,'彭嘉麒','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726841584880_7760232518.jpg','男','江苏省徐州市邳州市','南岭校区','2024','通信工程学院','自动化','20240320','1735514274','13813773893','1735514274@qq.com','电控组',1,'软件组',0,'新大一自动化专业的小白一枚','想借助社团督促自己在大学继续努力，同时也在社团学到本专业的更多知识','有志同道合的朋友和更充分的专业知识','社团比较忙，要加班，对自学有要求。但内容还算有趣'),(41,'崔鑫杰','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726843511877_4592743119.jpg','男','山西省运城市闻喜县','南岭校区','2024','交通学院','交通运输','17240109','2559093470','15635912646','2559093470@qq.com','机械组',1,'电控组',0,'   我是来自交通运输专业的崔鑫杰。希望能加入我们学校的吉甲大师社团。\n  我是一个热爱学习，善于思考的人。我喜欢挑战自我，不断突破极限。同时，我也是一个团队合作者，我相信，只有团队的力量，才能让我们在困难面前不屈不挠。我期待在社团中，不仅能够提升自我，也能够为团队贡献自己的力量。','    我选择加入社团，是因为我渴望挑战自我，我渴望在实践中学习，我渴望与他人合作，共同成长。\n    社团为我们提供了一个挑战自我的平台。在这里，我们可以尝试那些挑战，虽然可能会让我们感到困难重重，但正是这些困难，让我们有机会超越自我，发现自己的潜力。\n    社团是一个实践学习的场所。在这里，我们不仅仅是学习理论知识，更重要的是，我们可以通过机械组以及电控组的不断运用强化提升自己。提升团队合作能力','   首先是技能的提升。社团是一个实践的舞台，在这里，我们可以将理论知识转化为实际操作，通过参与各种活动，提升我们的沟通能力、团队协作能力和解决问题的能力。 \n    然后是我们期待的是自我价值的实现。在社团中，我们可以找到自己的位置，实现自我价值。每个人都有自己的特长和兴趣，能够参与到自己喜欢的机甲制作中去。\n   最后，是对大学生活的不断丰富。',' 吉甲大师是由机械电控以及ai软件运营各小组共同配合，从而组装出英雄哨兵等一系列负责各项职责的机甲，参与robmaster竞赛的队伍，他不仅仅是对知识的实践运用，更是团队合作竞技淋漓尽致的体现。'),(42,'李治斌','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726840758667_5830537654.jpg','男','辽宁省凤城市','南岭校区','2024','机械与航空航天学院','工业工程','14241007','3793217352','15164359569','lizhibinsir@qq.com','机械组',1,'视觉组',1,'来自辽宁省丹东市，毕业于丹东市第二中学，在高中接受过物竞内容，之前对机器人对抗这方面很感兴趣，但是并没有学习系统知识，但对这方面的比赛十分感兴趣。','高考失利，未能考入自己最喜欢的兵器专业，但对兵器、武器发射等知识十分感兴趣，通过宣讲也了解到飞镖发射站有些欠缺，正好学长在介绍中也提到这个发射站就像一个迷你导弹，所以在这机缘巧合下，想要加入吉甲团队，也能提升自己的能力，并为吉甲大师尽自己的微博之力。','了解并掌握更多工科知识，认识更多的优秀吉大人，成就自己，为吉甲大师贡献自己的微博之力。','人比山高\n脚比路长\n永不言弃\n吉甲永垂'),(43,'李俊博','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726845736514_4692029208.jpg','男','辽宁沈阳','南岭校区','2024','机械学院','工程力学','14241127','3461613878','19314551929','qq3461613878@163.com','机械组',1,'视觉组',1,'24工程力学新生，零基础萌新','对机甲大师感兴趣，也想通过实践来巩固强化专业技能','期待能通过努力学习进入吉甲大师的第一梯队，也期待能通过比赛结识大佬，强化知识技能','robomaster是大疆创新发起举办的机器人竞赛，吉甲大师队伍名称TARS_Go,在2024年获得三十二强成绩。\n'),(44,'彭旭','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726847374093_2593878625.jpg','男','吉林省松原市','南岭校区','2024','材料科学与工程学院','材料类','16241021','1544063118','13364387181','1544063118@qq.com','电控组',1,'视觉组',1,'我对机器人具有很高的兴趣和热情 同时具备一定的自主学习能力 具有坚定的意志和信心去做好一件事情','喜欢机器人 对编程和电路感兴趣 喜欢团队合作去完成一件事情','希望我能通过培训和自我学习获得新的技能 希望能精益求精 在我所负责的领域将机器人升级强化 在赛事上大放异彩','我的了解是一个科技竞赛类社团 社团里有很多厉害的学长们培训带队我们 然后很多人在一起讨论完善 最后带着大家共同的成果走上赛场 我觉得这是一件非常有意义的事情 非常有凝聚力的社团'),(45,'邢中正','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726831414167_1851193827.jpg','男','山东省淄博市','南岭校区','2024','机械与航空航天工程学院','工业工程','14241013','1801614550','13220680399','1801614550@qq.com','电控组',1,'软件组',0,'爱好计算机，接触过单片机，略学过一点iic、spi啥的，画过pcb，有点基础。会焊接，万用表会一点。希望能加入电控组','wok\n机器人巨帅的好吧\n而且一起研究创造也很有意思','可以进一步精进我嵌入式的技术能力，享受一起研究开发的过程，结交朋友，拿奖 ;)','不像初高中那种给一堆封装好的函数，是真正研究原理和技术的社团。'),(46,'赵桐','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726885183532_1608310632.jpg','男','黑龙江省绥化市','南岭校区','2024','机械与航天航空工程学院','机械工程','14240714','3328115857','15804558759','zhaotong9924','软件组',0,'电控组',1,'本人性格开朗、稳重、有活力,待人热情、真诚.工作认真负责,积极主动,能吃苦耐劳;喜欢思考,虚心与人交流,以取长补短。我同所有的报名者一样，渴望展翅高飞，渴望将来有更大的发展空间，有施展才华的更广阔的天地。','我对机械控制与设计具有浓厚兴趣，励志成为机器人制造方面的人才，希望通过在吉甲大师队伍中学习、培养，并为队伍做出贡献','期望可以通过队内的培养掌握机器控制的相关知识，并成为队内的积极分子，希望尽自己的微薄之力为吉甲大师在赛场上的表现助力','吉林大学TARS-GO战队成立于2018年底，取名TARS-GO，源自《星际穿越》中和宇航员一起探索浩瀚宇宙的机器人TARS。其寓意是外在做事沉稳有条，内在思维活跃创新。不同学科和不同专业学生的加入，丰富了战队的模块。在机械、电控、视觉、决策等组别的努力下，这个勇于逐梦的团队如今已经开始围绕“智能机器与系统”，大胆探索多元化、创造性和适应性的交叉学科培养体系，为形成跨学科、国际化的新工科开放实验平台而努力。'),(47,'徐锦坤','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726890097610_0174944110.jpg','男','河南省安阳