，从而提升自己的能力，为吉甲大师发挥自己的光和热。','收获志同道合的朋友，提升自己的能力，享受竞技的快感。','吉甲大师不是一个人简单的项目，是一路走来的团队共同铸件的标志。'),(83,'王昊','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726921173988_5746432604.jpeg','男','河北省','南湖校区','2023','通信工程学院','通信工程','23220614','1657780640','15131009771','1657780640@qq.com','电控组',1,'AI组',1,'我是通信工程学院的学生，对单片机编程特别感兴趣，已经自学完C语言、stm32的一些相关知识，想将自己的所学知识应用到实际的项目当中，提升自己的能力，也为吉甲大师做贡献','一方面能够提升自己的能力，为自己以后的就业发展提供帮助；另一方面也希望能够为吉甲大师做贡献，和大家一起进步','期待能够在吉甲大师中收获一群志同道合的朋友，也希望能够提升自己的水平，丰富自己的视野，为自己的未来提供帮助，为吉甲大师做贡献','吉林大学吉甲大师双创实践基地成立干2018年12月。现已发展成为吉林大学一个跨南湖、南岭、中心校区的综合性极强的大型平台组织。成员横跨文、理、工、管多学院。\n 	通过参加RoboMaster机甲大师赛及其它竞赛，设计研发产业需求的产品，项目式培养学生的工程实践能力，追求极致、勇干创新的专业能力，遵从本心、服务社会的内驱力和执行力，有责任心和全局观的团队精神等素质，让心杯梦想的人创造价值。\n队员必须具备的四个品质，也是入队考察的必要品质：热爱，极致，认真，专一。队伍口号：凝聚，齐心协力！突破，永无止境！'),(84,'王涛','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726921142820_9381831734.jpg','男','云南省保山市','南岭校区','2024','机械与航空航天工程学院','机械工程','14240209','2193689304','19869397535','2193689304@qq.com','电控组',2,'机械组',1,'大家好，我是2024级机械工程专业的，从小便对电子机械赛车等感兴趣，主要想在大学生活中提升自己的能力，拓展自己的知识，同时也结交到跟多优秀的同学。所以我真心希望能够加入吉甲这个优秀的团队。','  我想要在大学期间可以更多的掌握一些新技能，同时可以精进的获得莫一方面的技能。希望在吉甲认识到更多优秀的人。','收获：交到新的朋友，获得新的知识\n目标：第一学期掌握基本专业知识\n     第二学期精进自己的技能','吉甲是一个团结有爱，有创新的团队'),(85,'李欣晏','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726920866530_6181964583.jpg','男','吉林省镇赉县','南湖校区','2024','通信工程学院','信息工程','20240921','3788723660','15734367136','3788723660qq.com','视觉组',1,'电控组',0,'一只希望加入吉甲大师的新生','希望锻炼自己的交流能力','结交朋友和锻炼自己的决心，提高自己的工程能力','用项目任务来提高学生的交流和工程能力，在竞赛中培养学生的交流能力和团队合作精神'),(86,'王丹檬','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726920572786_2980349064.jpg','女','陕西省咸阳市','南岭校区','2024','汽车工程学院','车辆工程','15240602','3793580528','17734624604','3793580528@qq.com','机械组',1,'视觉组',1,'待人友善，选择性社恐','精进机械技术，对rm机器人设计，rm比赛机制比较感兴趣','收获：熟练运用CAD等\n目标：参加比赛','吉林大学在rm方面逐渐上升的一支前途光明，厚积薄发的队伍，五年来求实创新励志图强，起步晚但是参与者认真，老师负责，成绩一直进步。'),(87,'李振荣','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726920625586_4763099663.jpg','男','甘肃省古浪县','南岭校区','2024','机械与航空航天工程学院','机械工程','14240308','3081366583','17262948608','3081366583@qq.com','机械组',1,'运营组',1,'我是机械与航空航天工程学院24级新生李振荣，平日喜欢听音乐，看书','自学长在军训期间对吉甲大师的宣传让我对rm有了初步了解后，我就不断的想对吉甲大师进行更深的理解，在这个过程中，我结识到了一些有趣的学长和学姐，对solidworks的学习也让我受益匪浅，因此，我希望加入吉甲大师。','熟悉solidworks，cad，artcam，ANSYS等软件操作，完整经历机器人设计流程，培养团队精神与责任心，加强自身人际交流与合作能力。','吉甲大师是吉林大学一个跨校区的竞赛战队，它多次在竞赛中取得过良好成绩。'),(88,'刘文博','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726921206424_5043909537.jpg','男','河南省许昌市','南湖校区','2024','通信工程学院','通信工程','20241427','3368405172','16637478625','3368405172@qq.com','电控组',1,'软件组',0,'我来自河南许昌，2024级的通信工程学院通信工程新生，是一个比较内向的男孩，平时爱打王者荣耀，对moba游戏有一定的理解，愿意为吉甲出一份力','我期待可以在比赛场上发挥自己的作用，我期待可以锻炼自己，增长自己的实力，开阔眼界，培养能力，丰富大学经历。我渴望在赛场上出一份力。','开阔眼界，丰富阅历，认识志同道合的新朋友，在各个方面有所成长，比如编程方面的知识\n先加入吉甲再一步步成长，完成考核和培训，争取可以成为正式队员，以后有机会为比赛出力','了解新生的知识和相关比赛视频，对各个项目组有一定的了解，了解过去的成绩，粗略了解一些机器人的知识'),(89,'张哲','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726920545177_7627253473.jpg','男','吉林省永吉县','前卫南区','2024','物理学院','物理','11240318','1733077966','13604463073','1733077966@qq.com','机械组',1,'电控组',0,'我是来自物理学院的学生，平时能主动学习课外的知识和一些技术，并经常关注机甲大师的比赛和各高校的技术突破，','在网络上了解到机器大师，并对机器人的结构和制作产生兴趣，同时想在大学期间提高自己的实践和自主学习能力','学会3d建模的应用并提高自己将纸面上的设计变成现实能在机器设计和组装上有一定成果','是一个综合性极强，强调创新和实践不断突破的实践基地，致力于培养学生的创新能力和团队协作能力'),(90,'崔镕国','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726920449622_1610519698.jpeg','男','吉林省和龙县','南湖校区','2024','通信工程学院','通信工程','20241429','2305797612','18764661372','2305797612@qq.com','电控组',1,'软件组',0,'来自山东潍坊高密，接触过机器人比赛，曾经接触 学习过c++  python的基本知识。但高中荒废了，在努力捡…','小学 初中接触过机器人编程比赛，对rm比赛很感兴趣，想尝试一下','与更多厉害的人接触，学习新知识提升自己','听了玄老师描述感觉吉甲大师发展到今天的规模非常不容易，是一届届学长和老师用热爱经营的有组织有凝聚力的团队。希望本人也能加入吉甲的大家庭一同为竞赛努力，给后辈铺路'),(91,'余浩','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726921932430_5631111499.jpg','男','安徽省宿州市','南湖校区','2024','通信工程学院','通信工程','20241718','2153228890','18855742486','2153228809@qq.com','电控组',1,'视觉组',1,'本人性格沉稳，学习能力较强，态度认真，做事踏实，对编程代码和机器竞技有很大的热情','对RM竞赛有很大的兴趣，热情高涨，同时期待学习更多的知识，磨砺自己，期待获得重大的收获，使自己的大学生活更加丰富多彩','学会各种编程和机械知识，增强团队协作和人际交往能力，进入RM赛场参与对抗，取得不错的成绩','吉甲大师是由通信工程机械、软件计算机电子等多个学院的近百名机器人爱好者组成，包含机械设计，电机控制，嵌入式与通信，定位与运动规划，视觉识别，决策与统筹调度和项目管理等七种分工。团队倡导追求极致，勇于创新的专业素质打造有全局观和责任心的团队意识，希望培养出一批富有才华的工程师和科学家。'),(93,'刘爱佳','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726922174715_6107712983.jpg','女','河北省邯郸市大名县','南湖校区','2024','通信工程学院','信息工程专业','20241107','976461704','15531053032','976461704@qq.com','电控组',1,'视觉组',1,'刘爱佳，来自河北邯郸，信息工程专业，有一定的意志力和自制力，对实操制造感兴趣','高中填鸭式分数论的学习让我上大学之后一时没有目标，希望通过专注一件事情充实大学生活，提升个人能力，同时也是挑战自我，突破极限','希望可以学习专业能力，增强自信心，能够独当一面也能很好的进行团队合作，收获独一无二的人生经验。目标就是可以顺利入队参加比赛','吉林大学机甲大师2018年成立，虽然起步艰难，但是成长很快，到现在也渐趋成熟。属于培养式的项目，给予学生发展个人能力的平台，可以将学到的知识真正用于实践，做出独立的产品'),(94,'冯博伟','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726922111810_3559455059.jpg','男','河北省沧州市肃宁县','南湖校区','2024','通信工程学院','通信工程','20241411','3978674270','18031762597','3978674270@qq.com','视觉组',1,'电控组',0,'冯博伟，河北人，有热情加入视觉','提升自我，喜欢机器人','达标参赛','很好'),(95,'田浩南','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726920883485_3549594060.jpg','男','河北省邯郸市','南岭校区','2024','机械与航空航天工程学院','机械工程','14240817','1829540127','18732052235','1829540127@qq.com','机械组',1,'视觉组',2,'我是来自河北省邯郸市的田浩南，是24级机械工程学生，平时爱动手拆解修理一些东西，对机器人比较感兴趣，虽然不打moba游戏，但是感觉机器人还是太帅了。希望加入机械组','对机甲的热爱！在被吉大录取之前就看过一些rm的比赛了，没想到来到这里真的可以加入tars_go战队，这即使因为喜欢，也能提升锻炼自己','希望能为吉甲做出一些贡献，感觉吉甲的飞镖系统还有提升空间，其次希望多认识一些学长学姐可以提供帮助，增加一些经验和阅历，能学习一些机械相关的知识，和自己的专业相辅相成。','tars_go!战队，成功进入全国决赛，曾战胜西北工业大学，工程机器人很给力，英雄超准！'),(96,'郎俊鹏','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726922039059_8217742051.jpg','男','山西忻州','南湖校区','2024','通信工程学院','信息工程','20240919','2513430240','17804313668','2513430240','视觉组',1,'电控组',0,'我来自山西，是信息工程的学生，喜欢酷炫的东西，平时性格随和，也积极有趣，很希望和同学们交朋友，同时磨砺自己的能力','很喜欢机器人，也很喜欢大家一起向着一个目标努力的感觉，更喜欢比赛场上大家一起为梦想拼搏的热血感，也希望可以借此得到一个更好的历练','更好的学习专业知识，更加了解整体项目的推进和进行，锻炼更多能力，见识更大的场面','吉甲大师是一个众志成城，历经艰难险阻，最终成立起来的我校一个很有名的社团，酷炫团结，努力创新，学长学姐都又有能力又热心'),(98,'张浩浩','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727093150225_3961361018.jpg','男','甘肃省成县','南湖校区','2024','通信工程学院','信息工程','20240920','3329648835','18294652083','3329648835@qq.com','AI组',1,'电控组',1,'大一新生','向往','有所得，有所获','仅限于迎新群和视频'),(99,'黄浩哲','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726923687718_3111736425.jpeg','男','四川广安','南岭校区','2024','材料科学与工程','材料类','16241115','3569583493','18080286558','3569583493@qq.com','机械组',1,'电控组',0,'自幼喜欢积木拼装，初中参加机器人课外活动，曾在初一时荣获广安市六足竞走机器人比赛一等奖，高中时了解到robomaster此比赛。本人对3D打印，机器人制作非常感兴趣。','希望能提升自己综合能力、实践能力等，希望进入战队并取得一定成果，为以后的保研甚至工作添上一笔。','对各种软件的熟练使用，提高对专业知识的理解与运用，理解机器人的工作原理，能够自己研发并制作无人机。','其旨在提高大学生运用监控视觉等技术解决实际问题的综合实践能力和创新创业能力'),(100,'韩淏','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726924407952_9921846470.jpeg','男','河南省濮阳市','南湖校区','2024','通信工程学院','信息工程','20241021','195864617','15041155721','195864617@qq.com','软件组',0,'AI组',1,'我是韩淏，大一新生，信息工程，正在学习c语言，对编程开发比较感兴趣，希望能加入软件组。','丰富大学阅历，提升个人水平','提升个人实力，争取拿奖','闲暇经常在b站观看比赛视频，比较了解比赛规则'),(102,'刘建超','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727148214218_9747027845.jpg','男','辽宁省铁岭市','南岭校区','2024','机械与航空航天工程学院','机械工程','14240612','2030686634','13555043617','2030686634@qq.com','机械组',1,'电控组',0,'我叫刘建超，男，机械工程2024级学生，喜欢机械方面的事情','没有哪个男孩子小时候没有一个机甲梦，从小时候动画片里的千奇百怪的机甲，再到如今的机甲大师，他们都深深地吸引着我，我渴望加入机甲大师，也愿意为他投入时间和精力，去实现我的机甲梦','能够熟练掌握CAD等软件，有着更好的实践动手能力与团队协作能力，丰富自身经历，提升自身能力','吉甲大师是一个横跨多个校区的社团，各个部门各司其职，去创造机甲，运营项目，打比赛，获得东部赛区八强，北部赛区32强'),(103,'叶卓','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726924824978_9069294182.jpg','男','江苏泰州','南岭校区','2024','生物农业与工程学院','农业机械化及其自动化','18240324','2359872053','17799808351','23598723053@qq.com','机械组',1,'电控组',0,'本人有很强的进取心和求知欲，热爱学习，追求进步，来自农机专业与机械组对口，有更大的进步空间','因为我来自农机专业，专业对口选择了机械组，希望能在社团活动中对所学知识加以实践，更好的提升自己','希望增强我的团队协作能力和专业素养，在机甲大师这个团队获得更好的发展。','是吉林大学学子展现自我、获得提升的优秀平台，可以让学生在有趣的实践中获得更大的进步。'),(105,'王赛','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726925404541_2448760284.jpg','男','四川省成都市双流区','南岭校区','2024','仿生科学与工程学院','仿生科学与工程','18240631','2897747906','19827807151','2897747906@qq.com','机械组',1,'电控组',0,'我热爱机械拼装，活泼开朗，善于与他人相处，乐于助人，有恒心，毅力，善于团队合作，有创新思维。','希望参与战车的制造中，结交新的朋友，掌握新的技术，度过一个充实的大学生活','期待能深入加入活动中，认识新的朋友，掌握新的技能，开拓眼界，有一个充实而难忘的大学生活','吉甲大师是吉林大学的官方战队，有独特的三创教育培养方案，打造产教融合的多层次培养路径，并取得了丰硕的成绩，培育出了许多优秀学员。'),(106,'王传帅','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726928342725_6274813789.png','男','山东省菏泽市牡丹区','南岭校区','2024','通信工程学院','空间信息与数字技术','20240619','2244831324','13583002251','2244831324@qq.com','软件组',0,'运营组',1,'咱作为一个来自山东的小deng，王传帅，性别男，能从山东杀出来来到吉林大学通信工程学院空间信息与数字技术专业，血雨腥风，咱的韧性可想而知；当然咱的沟通方面也是有一定能力的，不过可不是社牛。在之前呢，咱也看过相应的机器人比赛，一路痴迷，再加上对编程软件有一些兴趣和膜拜（当然可以说是零基础）所以在了解到吉林大学有咱吉甲大师这样的组织团体后，也是十分向往，但又怕自己能力不够，所以一直在徘徊。听完宣讲会后，了解初步进入大师热情当先，所以我也怀着一颗赤诚热爱的心，冲一冲吉几把大师，冲一冲软件组！','对机器人和软件两方面都有兴趣，吉甲大师软件组这样一个集体，正是我的理想团体，结合了我的兴趣，又同时可以锻炼提高我的编程软件能力并提供更多接触机器人的机会。更重要的是在这个理想集体中可贵接触到很多大师学长，了解以后的路，了解更深的软件知识和机器人信息，让自己大学更加多元，能够使自己更加全面，所以吉甲大师软件组是我的不二之选。','1.了解相关机器人信息，虽然软件组对实际比赛的参与不多，但是无可避免肯定会了解相信的信息，可以完善对机器人以及RM的了解\n2.熟练掌握软件编程技术，软件组不负其名，在学长带领和自己的学习下，可以把自己一直想做的编程相关进行一个系统且深入的学习\n3.知悉后台管理系统运行情况，听完宣讲会后，对我之前的理想组别更加坚定，对系统的管理组织必定会是自己的一项特殊技能，在日后会是自己的发光点，是从吉甲大师带走的财富\n4.竞赛的经验与可能获得的奖项，大创，互联网+，计设，希望能有机会参加，同时希望在大佬学长的带飞下可以获得一两个奖项，点缀自己\n5.加入吉甲大师后我那同学兄弟们羡慕的目光，这很重要！我可以无限炫耀我的大师身份！','吉甲大师战队也是我们的TARS-GO战队，在第一次亮相于2020年RM大赛时就荣获一等奖，直接一骑绝尘，出名全国。而且在人工智能挑战赛中，我们战队还荣获了二等奖，又一次闪亮了战队名字。当然这些都可查，而对于我个人见解，吉甲大师是我们吉大数一数二的集体，一个庞大有组织的团队，技术组实力在线，运营部分卓越出色，而且是绝大部分理工生挤破头进去的地方，咱也抱着虔诚的心态试一试，希望可以进入这个完美的集体！'),(108,'常睿哲','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726926969425_2495688186.jpg','男','河南省襄城县','南岭校区','2024','机械与航空航天学院','智能制造','14241225','2035657159','15093457697','2035657159@qq.com','机械组',1,'运营组',1,'我是机械专业的一名学生，主要想加入机械组，我在这方面没有什么基础，之前只参加过走线机器人的比赛但是我觉得我够肝，可以花时间学好，对于机械方面有较大热情，平时也喜欢足球等运动','我觉得机械组能锻炼我的能力，让我在以后不管是学习生活还是走到社会上工作后都能更加如鱼得水，机械组的工作在我看来也比较有意思。','主要是想学习如何从零开始构建一个机器人的框架，也想借此学习更多有关机械的知识，同时想要提高我自己与其他人合作的能力','我对吉甲大师的了解主要还是关于RM比赛方面，知道吉甲大师内部的分工，也在线下参观过，感觉吉甲大师的技术力很高，团队内部之间协作也很好，在RM比赛及其他方面都有很好的成绩，也十分注重学生的培养'),(109,'李亚丽','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726931050780_7038833286.jpg','女','甘肃定西','南湖校区','2024','通信工程学院','通信工程专业','20241308','3864621637','18719650011','lyk02243422@qq.com','电控组',1,'视觉组',1,'我叫李亚丽，18岁，来自甘肃定西，在吉林大学南湖校区通信工程学院学习通信工程专业，我一直对机器人技术充满热情，我非常期待能在吉甲大师这一平台上，与来自不同学科背景的同学们一起，共同探索机器人技术的无限可能，挑战自我，实现创新。','原因：\n首先，我对机器人技术和创新创业有着浓厚的兴趣。吉甲大师这个平台为我提供了一个展示自我、挑战自我的绝佳舞台。\n其次，吉甲大师注重跨学科合作和团队建设，可以锻炼自己的团队的协作能力和沟通能力。','收获： 不断挑战自己，提升自己的学业水平和实践能\n力，结交更多志同道合的朋友\n目标： 学好相关知识，代表学校打比赛。','吉甲大师是一个十分厉害的社团，但它不仅仅是社团，在吉甲大师这里能学到更多的知识，吉甲大师这一平台为我们提供了一个展示自我、挑战自我的舞台，同时激发学生的创新热情，提升学生的实践能力。吉甲大师是一个集竞赛、创新实践、团队建设与产教融合于一体的综合性平台，对于提升学生的综合素质、培养创新创业人才具有重要意义。\n'),(110,'王淑仪','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726933750048_2876511646.jpg','女','吉林省松原市','南湖校区','2024','通信工程学院','信息工程','20241101','1529172559','15543341566','1529172559@qq.com','视觉组',1,'电控组',0,'对于视觉组负责的任务和工作非常感兴趣，学习认真，态度良好','想通过团队的培训，以及竞赛的经历，学习更多的知识和技能，实现自己的价值','希望能提升自己的专业能力和团队合作能力，认识志同道合的前辈和朋友，能顺利进入决赛，留下珍贵的经验和回忆','横跨多个校区，成员横跨多个学院，是一个综合性极强的专业技术组织，是一个又热血又温暖的团体'),(111,'王邻皓','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726936935876_8105676982.jpeg','男','四川','前卫南区','2024','计算机与科学院','计科','21241010','3155789878','15884634554','15884634554@163.com','视觉组',1,'AI组',1,'我是24级计科新生王邻皓，通过学校招新宣传了解到了吉甲大师，并对此产生了浓厚的兴趣，为此我以自学了python与c++的基础语法，为后续的学习，比赛打下厚实的基础','有浓厚的兴趣并想提高自己的综合素养','打下扎实的编程基础的同时，收获更多的专业知识和友谊','吉甲大师是我校面对机甲大师赛事开设的机器人社团，其社员目的以培养学生兴趣为主，为学生提供了丰富的学习生活和经历'),(115,'郭南希','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726977284177_8530239435.jpg','男','湖北省襄阳市','南岭校区','2024','机械与航空航天','智能制造专业。','14241210','3483931939','13387216399','3483931939@qq.com','机械组',1,'电控组',0,' 从小对机甲非常感兴趣，学习和动手能力强，可以接受假期留在团队工作','希望丰富自己的实践能力，期待与学长们共同合作打造自己的机甲，实现从小的梦想','可以学习到丰富的知识与技能，能融入到团体感受团队的温暖，和大家一起创造出更好的成绩','一个积极向上，团结友爱的实践团体。能培养大家的合作能力与创造精神能教会大家重要的工作技能。一个为梦想搭建舞台的社团。'),(117,'陈泽莉','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726977669842_8879276821.jpg','女','广东省','南湖校区','2024','通信工程学院','信息工程','20240803','2040334960','13322788493','2040334960@qq.com','视觉组',1,'电控组',0,'老师，学长学姐好，我叫陈泽莉，来自广东省，是2024级信息工程的学生，暑假期间观看了吉甲大师的全国赛，加上一些其他学校有在打这个比赛的学长学姐的介绍，让我对吉甲大师充满了兴趣，所以在暑假期间学过几天的C语言，但是只是略微涉及一点点，，还是希望可以进队学到更多的东西，参加打比赛。个人比较能够吃苦耐劳，做事也比较认真，人际交往能力也还行，可以很好的团结身边的同学和队友。','真的对打比赛很感兴趣，很希望可以在打比赛的过程中学习到一些东西，提升自己各方面的才能吧！','希望自己的代码能力可以有质的提升，可以培养自己的团队协作能力，希望自己可以打进全国赛，为吉甲大师的佳绩贡献一份自己的力量吧！','吉甲大师是我们吉林大学专门打robomaster机器人大赛的一个团队，在玄老师的带领下已经举办5年了，这五年来一步步成长，进步，成功进了全国赛总决赛，也取得了很不错的成绩，在变得越来越好了，然后吉甲大师对队员能力要求可能也比较高，需要走自己设计机器人，组装机器人，到自己写编程，上场操作机器人打比赛等等一系列的完整流程。也需要队员之间不断的沟通协作吧！'),(118,'王鑫龙','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726979923094_1790469547.jpg','男','安徽省怀宁县','南岭校区','2024','汽车工程学院','车辆工程(饶斌班)','15241616','2078174285','18855601318','2078174285@qq.com','视觉组',1,'电控组',0,'希望向汽车智能化、自动驾驶方向\n希望能在rm的比赛中收获经验、能力与好友','对rm比赛的兴趣，希望能将兴趣和能力提升结合','提升编程能力\n结识更多朋友\n','英雄机器人很强\n战队专业、系统'),(120,'赵士文','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726983464322_9052441242.jpg','男','陕西省榆林市定边县','前卫南区','2024','地球科学学院','地质','22240609','2862821696','15877589600','2862821696@qq.com','视觉组',1,'AI组',1,'我来自陕西，对深度学习中的强化学习，以及图像解析感兴趣','渴望进一步提升自己的编程能力，在吉甲大师的团队中收获一批志同道合的朋友','1.过硬的编程能力\n2.良好的深度学习基础\n3.志同道合的伙伴\n4.全方位的项目式经历\n目标\n1.扎实的c++基础\n2.深度学习的模型熟悉并运用','吉甲大师是一个项目式培养的团队，横跨南岭，中心，南湖多个校区，囊括文，理，工，商多个学院'),(123,'马煜城','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726988577423_5145052008.jpg','男','吉林伊通','南岭校区','2024','生物与农业工程学院','农业机械化及其自动化','18240307','2927635018','15844469958','mayucheng060623@163.com','机械组',1,'视觉组',2,'我从小对机械拼装等抱有较大兴趣，也曾经组装过一些机械拼搭，并且我的家于学校的距离也很近，能随时出席各种活动','自身的专业为农机，希望应用自己的专业','能参加比赛，完成学业，应用自己的专业，积累经验','吉甲大师是一个专业的平台，能实现自我的价值，与我的梦想'),(124,'苏灿','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1726991683355_1249080452.jpg','男','河南省安阳市','南岭校区','2024','汽车工程','车辆工程','15240209','2074298549','15737258069','2074298549@qq.com','视觉组',1,'AI组',1,'我是苏灿，2024届汽车工程学院的一位新生。','希望获得充实而有趣的大学生活','希望获得知识与志同道合的朋友，\n尽自己所能做到最好','成立于2018年12月，助力心怀梦想的人创造价值'),(125,'李柄辉','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727000089445_6921622917.jpg','男','吉林省通化县','南岭校区','2024','材料科学与工程学院','材料类','16241124','121721555','18043503180','121721555@qq.com','机械组',1,'运营组',1,'我是材料类新生，从小比较喜欢组装模型，做事认真，遇到困难也不会轻易放弃。','看到了学长在公寓楼下做宣传，自己也比较喜欢机器人之类的视频和比赛。','交往更多志同道合的人，学习更多知识充实自己','吉甲大师战队名叫TARS-GO，曾取得2023年北部赛区32强，2024东部赛区8强，全国赛2胜，口号为：凝聚，齐心协力，突破，永无止境。'),(126,'谢昂辰','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727003326949_6934753439.jpg','男','浙江省湖州市安吉县','南岭校区','2024','仿生科学与工程学院','仿生科学与工程','18240621','1985763265','18257272668','1985763265@qq.com','视觉组',1,'AI组',1,'热爱编程，物理\n信息学竞赛省二\n物理省二','热爱机器人，初中就开始了解rm','学习软硬件知识\n希望能帮助吉甲大师再创历史','伟大无需多言'),(127,'张屹钊','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727004296663_0653759804.jpg','男','山西吕梁临县','南岭校区','2023','交通学院','汽车运用工程','17231032','475476673','16635895123','475476673@qq.com','机械组',1,'运营组',0,'我是23级交通运输（汽车运用工程）的学生，同时也是交通学院团委宣传部干事助理，有制作公众号推文排版以及可画封面制作的经验，也有使用Xmind、PPT、剪映等工具的经验；同时本人工程制图满绩（但是本专业没学过CAD，尚在自学），对机器人和研发有兴趣。也有一些MOBA和FPS游戏的经历，也想操控一下机器人满足一下以前的小梦想。','俗话说，光学不练假把式，何况我的动力往往来源于环境，恰巧我想起来吉甲大师能用到CAD等工具，边学边练还能帮到自己人，多好，所以想来看看；\n我情感上很向往一个和谐进步且有凝聚力的团队氛围，恰好看到了咱们组织的宣传视频，觉得挺对我胃口；\n另外，早就想玩玩机器人啦（虽然上次自己搞的无人机坠机了），去年都没能注意到有这个社团，导致错过了，如今一看机器人真的挺帅的，很想参与其中','能收获别人的信任，能学到真本事，能玩点感兴趣的东西，不辜负别人的信任，有一段难忘的回忆，对我来说就够了','2018年成立的双创基地，跨南岭南湖南区的大型组织，参加RoBomaster机甲大师赛及其他竞赛，入队需要的四大品质：热爱、极致、认真、专一，队伍口号是：凝聚，齐心协力！突破，永无止境！有六个技术组：电控组、机械组、AI组、视觉组、软件组、运营组。每个组（除运营外）分别有对应英雄机器人、步兵机器人、哨兵机器人、工程机器人、空中机器人、飞镖、雷达的位置。运营主要是宣传和财务。'),(128,'韩明郡','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727004295906_7315513491.jpg','男','吉林省吉林市','南岭校区','2024','仿生科学与工程学院','仿生科学与工程','18240630','2665570027','18943559853','hanmj9924@mails.jlu.edu.cn','机械组',1,'AI组',1,'我叫韩明郡，家住吉林省吉林市，是一个对机械和研究有很大兴趣的人。喜欢玩游戏和听音乐，希望和大家友好相处，成为吉甲大师的一份子。','对机械有很大的兴趣，从初中就关注机甲大师的比赛，想要参加比赛，获得成长的机会','学习更多关于机械设计的知识，积累研究交流的经验，在比赛中获得成长和友谊','一个很有潜力的战队，一个我未来要加入并发光发热，度过四年时光的战队'),(129,'温美馨','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727012938130_9065372696.jpeg','女','吉林省','南岭校区','2024','通信工程学院','机器人工程','20240403','917567154','15943642936','917567154@qq.com','电控组',1,'软件组',0,'我是24机器人工程的新生，也正是对机器人一类的东西感兴趣，才选择了自己的专业','在正式进入大学之前，我就有从一位南湖学姐那里了解到了吉甲大师，她说这是一个很有水准的社团，对个人能力有很大提升，而且说玄老师人也很好，水平很高，我期待加入吉甲，努力提升自己','要获得更多的专业技能，与各专业、各部门的同学进行友好交流，提升自己的团队协作能力','群文件的内容、视频我都有仔细看过，平时也从学姐那里了解到过一些'),(130,'何其锐','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727007224412_7171708072.jpeg','男','四川成都','前卫南区','2024','动物科学','动物科学','85240335','1966722715','18180514073','1966722715@qq.com','电控组',1,'机械组',2,'我对电子和机械特别感兴趣，而且也别会在网上自己找资料，自己去学习。','对机器人很感兴趣，而且小学时是在学校vex iq 机器人校队','收获专业知识，收获朋友','很帅'),(131,'赵文瑞','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727007355253_9297820453.jpg','男','黑龙江省齐齐哈尔市','前卫南区','2024','电子科学与工程学院','集成电路设计与继承系统','19241617','2748941200','18745276277','2748941200@qq.com','电控组',1,'软件组',0,'喜欢打游戏搞小发明','想参与机甲项目','能让自己更好理解专业知识 助力吉甲取得成绩','团结有热情'),(132,'刘天成','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727007410609_8434933623.png','男','辽宁大连','前卫南区','2024','地探','勘查','23240819','1277653293','15382217186','1277653293@qq.com','视觉组',1,'电控组',0,'从假期开始学习了一段Python','热爱','希望能成为正式队员','很热血的科技大赛'),(133,'徐鼎昕','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727007212352_6754795601.jpeg','男','黑龙江省齐齐哈尔市克山县','前卫南区','2024','仪器科学与电气工程学院','电气工程及其自动化','65240215','3436119736','15084545599','3436119736@qq.com','电控组',1,'机械组',2,'徐鼎昕，来自黑龙江齐齐哈尔，对机器人竞赛很有兴趣，喜欢新兴事物。','想要参与机器人研发，学习新兴事物，提高自己能力，参与国赛','参加国赛','研发氛围浓厚，组别分明，有相当实力'),(134,'黄牧天','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727007549082_4976939039.jpg','男','内蒙古自治区包头市','前卫南区','2024','计算机科学与技术学院','计算机科学与技术','21240321','3168364947','15829387868','3168364947@qq.com','软件组',1,'AI组',2,'大家好','向往这样的团队和机会','收获过硬的技术与美好的回忆','厉害'),(135,'杜士涛','https://tarsgo.xf233.com/tarsgo_cloud_service/