6','19543173683','2051571246@qq.com','软件组',0,'视觉组',1,'一名大二学生，会C语言，性格有些内向，态度比较端正','想在大学期间参加点活动，也想学些技术，结交一些朋友','能够学习并熟练应用学习到的技术（如数据库技术）','最初了解到吉甲大师是在大一纳新和比赛直播，看直播的时候也是非常激动人心（尤其是英雄10s推塔那段真的是非常帅），也是在上一届吉甲大师进了全国32强，这些年来能取得这样的成绩属实不容易，但我相信吉甲大师不会止步于此，在未来一定会取得更好的成绩。'),(146,'朱婧文','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727007976696_9994885456.jpeg','女','江苏盐城','前卫南区','2024','建设工程学院','土木类','24240901','1664221273','19816190168','1664221273@qq.com','机械组',1,'软件组',0,'莫名其妙地就喜欢买一些零件拼拼装装，乐高的机械组啦，一些金属材质的模型啦..然后很早就是一个MC\n嗯对自己认可的事很认真地对待，一路自学过来的，所以自己坚持下去对于我来说是很寻常的事','来玩，来拓展自己，来拿奖','看到更多和我原来的视界不一样的东西吧\n捞一捞和我志同道合的伙伴','嗯我喜欢的会为之努力的那种'),(147,'梁乔茜','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727008423534_5024589416.jpg','女','韶关市乐昌市','前卫南区','2024','仪器科学与电气工程学院','测控技术与仪器','08230516','1127297255','13602851125','liang_112729@qq.com','电控组',1,'视觉组',1,'梁乔茜，从行政学院降转到仪电学院测控专业2024级，对机器人以及动手实践充满兴趣，性格踏实沉稳，学习严谨细致，希望能有所收获，并在吉甲天下交到志同道合的好友','①对机器人的设计、搭建充满兴趣②电控组与我所学专业的主修课程重合度较高，在积极参与吉甲天下活动的同时不会太落下专业学习，压力相对较小也更容易做好分内的事③充实校园生活，找到自学的方向方法','①相关专业知识有所精进②交到志同道合的好友③养成更良好的、自觉自律的学习习惯和团队合作精神','自18年成立，有吉甲大师双创基地，由玄玉波老师指导，主攻RM大赛，一步步建设至今。若进入，有老师、学长学姐的指导，以自学为主，现将以大一为主力参加RM大赛'),(148,'宋宇桐','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727007653707_2611710856.jpg','男','黑龙江省佳木斯市','前卫南区','2023','电子科学与工程','微电子科学与工程','19231627','1203639178','13351668543','1203639178@qq.com','电控组',1,'视觉组',1,'我是一个乐观开朗的人，不会因为小挫折丧失信心。我也有良好的情绪处理能力，平时情绪稳定，不会与队友吵架','对rm这个比赛比较感兴趣，也是想在大二这一年尝试一下挑战性的事物，很后悔大一刚来的时候没有参加','希望能在吉甲中丰富自己的经历，学习提升自己的能力，最好能获得点小奖。目标是参加国赛','通过宣讲会我能感受到吉甲的整个氛围是很好的，不管是学长还是老师都很开朗还互相开玩笑。我相信吉甲是一个有活力，有热情的社团'),(149,'徐梓洋','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727009132798_2632665186.jpg','男','辽宁省丹东市东港市','前卫南区','2024','电子科学与工程学院','电子信息类','19240110','3936333153','15041585008','3936333153@qq.com','视觉组',1,'电控组',0,'一位沉稳内敛，吃苦耐劳，愿意奉献的男生','希望能遇到志同道合的朋友，学习更多的技能，遇到更多的机会，遇见一个更好的自己。','希望掌握好应该掌握的技能，树立吉甲大师创造新的辉煌。','这是一个充满热情的队伍，有一群技术过硬，愿意奉献的队员。'),(150,'朱赣萍','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727010053749_0956462406.jpg','男','江西省赣州市赣县区','前卫南区','2024','动物科学学院','动物科学','85240324','2716314841','18479849254','2716314841','电控组',1,'运营组',0,'比较喜欢这种类型的游戏，在高二时参加中山大学的人工智能夏令营，学习过一点单片机，对此很感兴趣，后续计划转到电子信息，希望能够加入电控组。个人性格开朗，易于沟通交流。拥有一腔热血！！','对电控组在比赛中所做的职能很感兴趣，希望能够加入电控组学习有关知识，也为后续转到电子打下基础。希望能够在机甲大师电控组结交到很多志同道合的朋友。','学习有关知识和技术，锻炼自己团队合作能力和自主学习能力，结交到一群志同道合的朋友。','我先叠个甲，这是官方背书后续有我个人的理解：吉林大学通信工程学院的TARS-GO战队在RoboMaster2024机甲大师超级对抗赛·区域赛（东部赛区）中表现出色，成功晋级全国赛1。这个团队由35名成员组成，自2020年首次参加RoboMaster机甲大师全国赛以来，就展现出了强大的实力和团队协作精神，当时便获得了一等奖的好成绩。他们的成功不仅仅建立在团队合作之上，还源于对热爱的探索和实践中的不断磨炼。\n\nTARS-GO战队的研发“营地”位于吉林大学南湖校区内的吉甲大师双创基地。在这里，每个时间节点和任务都被明确地标示在墙上，体现了团队高效的组织和规划能力。最引人注目的是“凝聚,齐心协力”几个大字，这是战队勇往直前的精神动力。\n\nRoboMaster机甲大师赛是一个包含机械设计、嵌入式系统设计、机器视觉、人机交互、人工智能等多项技术的竞技赛事。TARS-GO战队根据技术需求，分为机械组、电控组、视觉组、决策组等7个组别，各组别在各自职责范围内紧密合作，共同设计和构建不同类型的机器人，如英雄机器人、哨兵机器人、步兵机器人、工程机器人、空中机器人等。他们严格遵守任务时间节点，确保机器人能够实现远程控制和自动射击，并且每年根据比赛规则进行优化和调整。\n我认为机甲大师是一个百折不挠，满腔热血的大家庭，大团队，大家为了自己心中的热爱和理想一起坚持努力，我希望能成为其中一员。'),(151,'鲍弋航','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727010971412_3166823004.jpeg','男','浙江杭州','前卫南区','2024','电子科学与工程','集成电路设计与集成系统','19241628','2020717375','15356690568','2020717375@qq.com','电控组',1,'视觉组',1,'我来自电子科学与工程学院，集成电路设计与集成系统专业。我对机器人很感兴趣，能够团队协作，希望学习新技能，善于吸收新知识，富有passion！','有亲学姐介绍！在吉甲大师能够学到很多技术，然后可以积累一些实验室经验？还对大创和毕设有帮助，如果能得奖的话还能加绩点！','希望能在不影响课程学习的同时收获竞赛经验，竞赛成绩和竞赛伙伴吧！','很酷，很硬核，成绩优秀（进国赛的那种'),(152,'滕浩标','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727011210995_0133067573.jpg','男','浙江','南湖校区','2024','通信院','通信工程','20241928','1106208493','13736972491','1106208493@qq.com','电控组',1,'软件组',0,'我是来自浙江的一名新生，对编程以及硬件都有很强的兴趣，所以想加入电控组学习技能，我现在还处于起步的小白，但是我会强烈的热情去学习成长。','审评们好，作为一名新生我想加入吉甲大师这个大群体去体会团队合作，以及专业技术。','提高自己的技能，努力成为赛队的一员','我了解到作为吉大最大的社团，吉甲大师是技术含金量非常高的的社团，这几天我也发现了指导老师与学长学姐非常随和有趣'),(154,'陈京州','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727010616091_3465838113.jpg','男','河南省周口市','前卫南区','2024','商学与管理学院','工商管理','35240733','3505383818','18240711721','18240711721@163.com','电控组',1,'软件组',0,'我现专业是工商管理，打算下学期转入电子信息科学与工程，我高中本身是一名理科生，较擅长数学和物理，是一名喜欢专研难题、专注、有毅力的学生，从小对机器人有极大的兴趣','当第一眼看到吉甲大师的招新时，我就眼前一亮，决心一定要进去，其原因并不是我能谋的大奖或奖学金，我发自内心地喜欢做机器人这个项目，感觉没有什么能比一群志同道合的人从无到有地作出一个个机器人更酷的事了，我希望能给自己一个机会','期待能和志同道合的朋友们一起完成各个项目，建立和谐默契的友谊；\n提高自己的学习能力，动手能力，团队协作能力等等；\n亲手创造令自己满意的机器人','吉甲大师创立于2018年，从一无所有到进入32强，到拿奖，一路充满艰辛，有困难，更有欢乐和成长，吉甲大师是一支专注、极致、热爱、精益求精的队伍，我希望能加入其中，贡献自己的力量'),(155,'张雅茹','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727011239864_8344968425.jpg','女','内蒙古自治区呼和浩特市','前卫南区','2024','计算机科学与技术学院','物联网工程','21241501','525748548','18100477006','525748548@qq.com','AI组',1,'软件组',0,'我叫张雅茹，毕业于内师大附中，土生土长的内蒙人，虽然我们那边较落后很少接触这些机器人之类的，但是0基础的话我觉得会更有学习的欲望，前进的动力，以及重头再来的勇气。','我学习的是物联网工程，这是一个培养复合型人才的专业，属于计算机，具有良好的编程能力培养体系，能够符合ai对较强编程能力的要求，并且本人对机器人方面比较感兴趣，希望能加入ai组；而软件组也是贴近计算机的，我相信能在这个组别发挥更大的能力。','希望能精进编程能力，并且有更强的组织能力，沟通能力，协作能力。','吉甲大师成立于2019年，其实是一个比较年轻的组织，不过在这些年老师和学长学姐的不断努力下，已经有了很多坚实的基础，我希望继续做一个铺路人，助组织发展的更加壮大。'),(156,'赵媛','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727010463596_2614745966.jpg','女','河南省平顶山市','前卫南区','2024','新能源与环境学院','环境科学与工程','25240306','1480057041','18137573663','1480057041@qq.com','视觉组',1,'运营组',0,'我叫赵媛，现在在新能源与环境学院就读，个人认为自己有较强的学习能力和适应能力，能够很快接受不同的工作学习环境，这些我认为有助于我快速适应前期的学习。而且我对时间安排上比较合理，能够平衡自我学业和吉甲大师学习之间的关系，我认为我能够在吉甲大师中坚持到最后。除此之外，我是个e人，比较外向，能够和其他成员和睦相处，有团队精神，所以能较快融入吉甲大师这个大家庭。然后就是，我真的非常喜欢机器人，我对吉甲大师tars_go战队有着非常强的认同感，我认为热爱可抵岁月漫长，我的热忱之心回会成为我日后学习的动力。','我个人在童年时期受到钢铁侠的影响，对机器人一类的就挺感兴趣的。到了高中时期，学校请来了一位学长为我们做讲座，更加深了我对机器人的兴趣，高中时就想着能够在大学时期参与自主研发机器人，尤其是后来在b站等平台经常能够看到一些和无人机，智能机器人相关的信息，让我对机器人的热爱十分高涨。\n来到了吉林大学后，吉甲大师让我看到了实现梦想的机会，加入吉甲大师，将会在学长学姐和老师的帮助下，通过自主学习掌握和机器人制造的相关知识，这些都是驱动着我参加这次招新活动的原因，非常期待能够加入吉甲大师，并在吉甲大师中收获成长。','希望能在吉甲大师这个团队中学到扎实过硬的Python，C++，Ros等一系列相关联的知识，能够熟练运用相关知识，达到解决问题的目的。\n除此之外，还希望能在吉甲大师这个大家庭找到和我有同样爱好的朋友，志同道合的伙伴，能在吉大的四年里共同进步。\n目标:能成为正式队员并且和吉甲大师一同闯入国赛，打破记录，收获好成绩，除此之外，还想要和吉甲大师的伙伴们一起参加大创等竞赛，并且取得一定的成绩','吉甲大师成立于2018年，横跨南湖，南岭，南区，成员横跨文，理，工，管等多个学院。\n我们的口号是凝聚，齐心协力，突破，永无止境！\n通过robot master比赛及其他竞赛，培养工程实践能力，追求极致勇敢创新的专业能力，让心怀梦想的人创造价值。\n团队取名TARS-GO，让我想到了《星际穿越》tars机器人，和宇航员并肩作战探索宇宙奥秘，和吉甲大师勇敢创新的内核相吻合。\n吉甲大师在2024年比赛中闯入国赛，离不开全体成员的努力。'),(157,'谢少博','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727011017345_6440929329.jpg','男','河南省南阳市','前卫南区','2024','商学与管理学院','管理科学与工程','35241334','2487419968','15137756798','xieshaobo2024@outlook.com','视觉组',1,'AI组',1,'我是一个相对乐观的人，我性格随和，容易与他人沟通，善于与他人交流，我有充足的好奇心，并且能够自己探索热爱的事物，我也是一个自觉的人，我可以严格要求自己，能够在事情上坚持下来，保持热爱，知道最后，我也是个有责任心的人，我在初高中担任过一些班委，尽职尽责','身为一个管科专业的人，专业可能与机甲大师无关，但我对这充满兴趣，我想通过这来提升自己，并且追随自己的热爱。在知道机甲大师后，我不断的查询关于这的信息，每每看到比赛，看到机甲我都热血沸腾，所以我想加入吉甲大师，并且一定会坚持下去','能够结交到一群志同道合的朋友，能够在技术上提升自己，提升自己的表达沟通能力，可以尝试新鲜事物，获得成长','我了解机甲大师在吉大分为运营组，软件组，AI组，视觉组，机械组，电控组这六个组，以及对于各组的分工职务，还了解机器人的种类，及其使用规则，比赛的一些规则，还有比赛的进程，比赛的一些要求，比赛机制等等'),(158,'秦浩然','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727011778448_9012141545.jpg','男','安徽省阜阳市','前卫南区','2024','仪器科学与电气工程','电气工程及其自动化','65240216','1611345713','13359541429','handsomeqin2005@163.com','电控组',1,'AI组',1,'我是24届电气2班的学委秦浩然，阳光开朗，喜欢机器人，喜欢电竞比赛，学习能力强，曾获得过高中阶段校级全科一等奖学金，生物一等奖学金，三好学生，学习优胜奖等奖励，有过操纵无人机的经历，善于与人沟通交流，喜欢社交，','喜欢机器人，喜欢电竞，对社交感兴趣，想在不断学习过程中提升自己，看到rm的比赛感觉很有意思，想亲身经历研究及操纵机器人，想代表吉大参加国赛','想在不断学习中提升自己的能力，社交中交到更多志同道合的朋友，想代表吉大参加国赛，和优秀的人竞争，拿到奖学金','机器人与电竞兼有，竞技合作性比赛，可以在这找到志同道合的朋友，可以在不断学习中提升自己的能力，TARS-Go成立于2018年底，吉甲大师是在不断摸索中慢慢成立的，是一个机甲社团，可在此不断体验机甲的魅力'),(159,'刘志远','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727012608893_0147705353.jpg','男','湖北黄石','前卫南区','2024','电子科学与工程学院','电子信息类','19241108','3573824975','13597712812','3573824975@qq.com','软件组',1,'运营组',0,'我在数学和英语方面比较擅长，我目前对于编程的知识储备虽然还不够，但我正在努力去学习，我相信在不久的一段时间我能逐渐成为一个有这足够能力的学生，希望能成为吉甲软件组的一员','在我们吉甲的家庭，我能遇见许多志同道合的同学，我很希望与热爱机器人，有着信念的同学一起合作。除此，我其实一直很热爱去设计软件之类的工作，我很乐意看到我设计的软件能够真正有着用途，被大家所使用，这也是我的热爱。吉甲真正的能给我提供一个遇见朋友学习的平台，所以我非常想加入我们吉甲的家庭','我希望我在计算机方面能够去做到真正的运用方面吧，不再是课本上的习题一样。以及我也很希望能遇见这样一群上进的同学，这样让我学习也很有动力。最后我觉得能够干自己热爱的事情本身也是一种收获。我希望我设计的软件或者程序能够帮助大家更便利的完成日常工作，让大家能更全方面投入吉甲的线下比赛','我认为我们机甲大师现在是一个比较成熟的团队，在听了讲座之后，里面的分工之类我觉得非常的清楚明白，同时也能够给我们大一新生一个很难得的机会。最近师哥师姐也是进入了国赛，让我这个新生也感觉到我们团队是很有上进心，能吃苦的团队，让我很期待加入'),(161,'张旭艳','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727009594752_7440962138.jpg','女','河北省邯郸市肥乡区','前卫南区','2024','仪器科学与电气工程学院','仪器类','65240407','3096290947','15932048088','3096290947','电控组',1,'机械组',2,'我对RM竞赛有着浓厚的兴趣，一直渴望能在这样一个充满活力和创造力的团体中学习与成长。我具备较强的沟通能力和创造力，性格沉稳踏实，做事认真负责，善于与人交流合作，能够快速融入团队。我也有较强的责任心，对待任务会全力以赴，努力做到最好。','首先，我对RM竞赛有浓厚的兴趣，希望能在社团的学习过程中收获快乐与成长，在这里 我可以接触到许多专业人士和先进技术，与大家共同学习，交流经验，不断提升自己的技能水平，同时希望为社团贡献力量，与大家一起努力创造一个更加优秀的社团','我希望能够提升自己的专业能力，通过社团开设的竞赛和项目积累更多的实践经验，同时结交一些志同道合的朋友，与大家共同进步。','吉甲大师是一个以学生为主体的多学科交叉平台，采用层级递进的项目式“三创教育”培养方案，着重培养学生的创意，创新和创业能力，我认为吉甲大师不仅仅是一个组织，更是一个充满机遇和挑战的地方'),(162,'吴轲凡','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727012177218_4630894645.jpg','男','江苏省苏州市','前卫南区','2024','计算机科学与技术','计算机科学与技术','21240322','2360411361','19350249326','kefan.wu2024@outlook.com','AI组',1,'软件组',0,'我是一名计科的大一新生，了解到吉甲大师后对其中的比赛内容以及所需的专业技能有了浓厚的兴趣，虽然几乎没有基础，但我相信在我的努力下能取得一定的成就','对比赛内容与所要求的专业能力有兴趣','具备一定的程序编写能力与算法基础知识\n获得实践经历\n加强团队协作与沟通能力','详细了解了机甲大师的比赛内容与机制\n观看了一定数量的比赛视频\n听学长学姐讲述了自身的参与经历'),(164,'李浩言','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727013224137_9129841145.jpg','男','吉林长春','南岭校区','2024','通信工程学院','自动化','20240206','2686563146','15568822336','hyli2024@mails.jlu.edu.cn','电控组',1,'运营组',0,'懂得配合团队成员，能为集体共同目标而努力；学习能力强，适应力强，能在短时间内融入一个新的领域，对机器人乃至机甲有着好奇和热情，很想通过参加这个社团提升自己','期望在团队中，与其他学长们交流能得到更多知识，并在实践中获得更多收获，也期望能和志同道合的同学一起并肩作战，也期望有更大的学习动力','能对C语言及单片机有更多的实践机会，也通过在比赛中收获快乐，收获经验，提升我的知识储备和团队协作能力。\n期望能在国内比赛中收获奖项，也期望收获友谊','是为数不多的能够参加比赛的社团，也是能够学习知识，实现梦想，培养优秀人才的基地。对团员们机甲的热情构成了社团的中心，能为国家输送更多人才的教育基地。'),(165,'皮宇欢','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727338574479_4624775129.jpg','女','湖南','南岭校区','2024','通信工程学院','自动化','20240102','2031591924','19729378596','2031591924@qq.com','电控组',1,'机械组',2,'喜欢打羽毛球，会小号。对吉甲大师SM比赛有较大兴趣，希望加入吉甲大师提升自己','深受SM比赛的吸引，希望有机会参与这个比赛。希望实践在自动化专业学习到的知识，强化专业能力，同时学习更加全面的知识，追求兴趣爱好。','在吉甲大师的学习和实践中巩固专业知识，丰富专业能力。同时扩展视野，见识更加丰富的专业世界。在本科期间打下扎实的基础，服务于日后的生活。','吉甲大师培养队员们的创新性思维，培养专业知识，旨在让每一位有相关兴趣爱好的同学都有发展的空间。凝聚，齐心协力！突破，永无止境！在团队协作中培养团队精神和责任意识。'),(166,'曹东翔','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727014590153_3242459910.jpg','男','河南省封丘县李庄镇贯台村','南岭校区','2024','机械与航空航天学院','工程力学','14241129','2125536316','15617853776','2125536316@qq.com','机械组',1,'视觉组',2,'来自郑州外国语学校，自我感觉学习能力挺好的，能够服从社团安排','希望有一个有意义的大学生活','尽量进比赛拿奖吧','感觉是一个内部和谐很有实力的队伍，大家都有一股劲能向一个方向前进'),(167,'孟佳雯','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727012757004_7098520613.jpg','女','河北省石家庄市','前卫南区','2024','仪器科学与电气工程学院','仪器类','65240706','3013117207','19331177985','3013117207@qq.com','电控组',1,'机械组',2,'好奇心与探索欲强，对编程，机器人等实践与知识有兴趣，有热情并且愿意付出时间精力去了解与学习','1.对机器人有兴趣和探索欲望\n2.被吉甲大师的氛围，坚持与传承所感染，希望结识志同道合的伙伴一起奋斗进步\n3.希望体验项目式学习\n4.希望通过吉甲大师的平台开拓视野，了解机器人发展前沿的信息动态\n\n\n\n','希望提高自身实践动手与自学能力\n希望在项目式学习中提高创新能力\n收获严谨的思维和解决问题的能力\n收获交流与协作能力\n目标：积极跟进要求，争取进入电控组贡献自己的力量','吉甲大师是一支聚集了一批热情，纯粹，理想主义的青年们的战队，队员与老师都因热爱与责任奉献着时间和精力，同时吉甲大师有很强的凝聚力与积极的氛围，为学生们提供了很好的自我成长平台。\n吉甲大师不仅专注于比赛，还将视野拓宽到社会企业的实际需求中，如宝马汽车盖板检测项目，因此是一支注重产教融合的队伍'),(168,'郑熙琳','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727015153423_9181678547.jpg','男','辽宁省营口市','南岭校区','2024','汽车工程学院','能源与动力工程','15241312','205679630','18624428578','205679630@qq.com','机械组',1,'电控组',0,'我爱好机械，想加入学习','小学开始就看国外的那种机器人比赛，以摧毁敌方机器人为唯一目的的那种，当时就有想法加入到造一台机器人中。我们rm则是一个不那么暴力的机器人比赛。了解到机械组也能运用到3d打印（我小时候的另一个愿望）我便更向往机械组。希望能实现小时候的愿望。','我希望收获到机械方面的知识。目标是在吉甲待下去。','吉甲大师是一个有校方支持，有历史沉淀，有和蔼可亲的指导老师的，有明确分工和明确目标的战队。'),(169,'邓圆圆','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727011732231_7834482853.jpg','女','安徽省阜南县','南岭校区','2024','通信工程学院','自动化','20240101','1763552308','15956869389','1763552308@qq.com','电控组',1,'软件组',0,'    我是一个比较沉默的人，性格较内向，做事比较严谨，没事时会打打羽毛球、乒乓球，做做手工，平时比较喜欢自己动手，好奇心较强，喜欢探索未知的事物，对机器人比较感兴趣。','    我一直对机器人存在较为浓厚的兴趣，尤其想了解其背后的原理，而吉甲大师不仅能提供这样的平台，还能教会成员更多的知识和能力，我很希望有机会参与设计机器人的工作，并看其焕发光彩。','我期待提升自己的软硬件设计能力，C语言程序设计水平，工作实践能力等，最希望能通过努力和队友们一起为咱们学校的TRAS-Go战队做出贡献，帮助我们战队更上一层楼。','吉甲大师双创实验基地成立于2018年12月，现已成为吉林大学一个综合性极强的大型平台，教给学生知识的同时也培养他们各种各样的能力。吉甲大师设有六个部门，各部门密切配合参加了机甲大师及其他竞赛,由玄玉波老师带领的TRAS-Go战队也在今年成功进入RM国赛。里面的队员都具备热爱，极致，认真，专一等品质，且队伍口号为：凝聚，齐心协力！突破，永无止境!'),(170,'张志远','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727016899084_7550371908.jpg','男','山西省临汾市吉县','南岭校区','2024','通信工程学院','机器人工程','20240406','350331945','18434787033','zzy.060201@qq.com','电控组',1,'视觉组',1,'我来自山西省临汾市，是通信工程学院机器人工程系的一名学子，我从小对那种机甲玩具，比如变形金刚，霹雳火，就很感兴趣，感觉那种格斗很刺激。本人乐观开朗，很外向，几乎不生气很温柔，说话直接，很好相处，希望可以多多关照','由于我对那种机甲的充满兴趣，而且很向往那种参加大型的赛事，我希望可以成为咱们吉甲大师里的一员，一起努力奋斗，实现一个小梦想','希望我可以交到不同学院的同学，扩宽个人的知识面，提升个人在计算机领域的才能Python等，掌握机甲的很多要点，同时能够在吉甲大师中发挥个人的才能，为咱们吉甲的发展贡献一份力','我主要了解咱们吉甲大师里的机器人种类也是通过咱们Q群里的介绍了解的，同时看到咱们打比赛里的布局\n主要记得英雄工程步兵哨兵空中地面机器人以及飞镖攻击\n'),(172,'雷泽宇','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727011952894_2698471033.jpg','男','河北省石家庄市','前卫南区','2024','地球探测科学与技术学院','勘查技术与工程类','23240119','2891862877','17367716117','2891862877@qq.com','电控组',2,'视觉组',1,'喜欢机器人，希望在大学对软硬件进行更进一步的学习','中学时通过了解到RM，觉着特别有意思，也想通过这个比赛锻炼自己','期待能通过学习，把一些想法变为现实，能够结交一些兴趣相投，共同学习的伙伴','是一个不断尝试，不断探索，不断试错，在失误中学习经验，总结教训的团队，更是齐心协力，为共同目标努力的队伍'),(173,'丁明荣','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727016485198_8704994604.jpg','女','山东省日照市','前卫南区','2024','材料科学与工程','材料物理','16240207','848296095','13555228169','848296095@qq.com','电控组',1,'机械组',1,'村民B','想获得成长，喜欢电子','希望结识朋友，学习知识\n希望之后自己的水平能参加电赛','团结友爱的团队\n负责的老师'),(174,'李昀朗','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727017431689_1313157385.jpeg','男','辽宁盘锦','前卫南区','2023','电子科学与工程学院','电子信息工程','19230422','2776292962','13942738250','2776292962@qq.com','电控组',1,'视觉组',1,'老师，学长学姐们好，我是23级电子学院李昀朗，我热爱嵌入式硬件、软件的开发，我在大一学习了stm32单片机标准库、HAL库的开发以及基于freertos操作系统的使用，PCB设计，熟悉solidworks的基本功能，会使用3d打印以及切片软件的基本功能，并在大一时参加了吉林省电子设计竞赛获得了二等奖。在大一时我了解到robomaster比赛以及吉甲大师战队，观看了一些比赛并对此很感兴趣，希望能在今年加入这个团队，和老师和各位前辈们学习，继续成长，取得成就。','我觉得加入吉甲大师战队，可以和学长学姐们学习技术，丰富自己的项目开发经验以及和不同项目组间的沟通、协作能力，希望能为吉林大学RM战队