站到全国大赛领奖台','一群热爱，乐观，创新，积极的学生，志同道合的人聚集到一起的大集体'),(202,'刘婷婷','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727078001719_4928451253.jpg','女','山西省大同市云州区','南岭校区','2024','通信工程学院','空间信息与数字技术','20240502','3513756476','15794003657','3513756476@qq.com','视觉组',1,'电控组',0,'玄老师好，各位前辈好，我是南岭大一空间信息的刘婷婷，平时喜欢听听歌，有点i，很想加入吉甲大师但是个新手小白，希望可以有机会试一试。','加入吉甲大师是很难得的学习更多专业对口知识，亲身学以致用的机会，我想抓住这次机会提升自己的能力，也为未来做好准备。','我希望自己可以学到很多知识，同时能提升自己的能力，努力为团队作出贡献，努力发光发热，遇见更好的自己。','凝聚 齐心协力，突破，永无止境。吉甲大师为学生工程实践能力和专业能力的提升提供了一个宽广舞台。热爱，极致，认真，专一的驱动下，实力和责任的加持下，吉甲大师大步前进。同时，我希望能够加入吉甲大师团队。'),(203,'牛谱淳','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727080062373_3759258697.jpg','女','山东省枣庄市','南湖校区','2023','通信工程','通信工程','20231406','2170537986','15588277928','2170537986@qq.com','电控组',1,'AI组',0,'喜欢羽毛球，看电影，正在学stm32标准库。','喜欢动手操作，机器人。想提高技术制造出一套赛车模拟器玩地平线4和自动多方位射击的无人机，认识同好。喜欢这种氛围。','提高软硬件能力，能制造出满意的东西。和队里一起努力，打进四强。','有英雄，哨兵，工程，步兵，无人机。用团队制造出来的机器人打攻防战。上个暑假取得了目前最好成绩闯入国赛。'),(204,'冯沐轩','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727080720336_6513810160.jpg','男','河北','南湖校区','2024','通信工程学院','信息工程','20240913','3065938814','13171869518','3065938814@qq.com','AI组',1,'软件组',0,'我来自河北，环境因素使得我有着坚强的毅力和高度的自制力和学习能力','对编程感兴趣，而且对专业知识掌握有帮助','争取留到最后','团结友爱，互帮互助，具有创新精神'),(205,'张文吉','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727081321053_4660719643.jpg','男','江苏苏州','南湖校区','2024','通信工程学院','通信工程','20241314','3586053810','13739164041','3586053810@qq.com','电控组',2,'机械组',2,'我是张文吉','爱好','认识志同道合的朋友，培养兴趣','团结合作的大家庭'),(207,'温元诚','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727081616306_2652501250.jpg','男','黑龙江省哈尔滨市阿城区金澜路','前卫南区','2024','电子科学与工程学院','集成电路设计与集成系统','19241517','2278834424','13304502005','yuncen33@qq.com','电控组',1,'AI组',0,'我是一个蔬菜','我是一个地瓜','收获果实','1.英雄机器人是战场上唯一可以发射（42mm）弹丸的机器人，击中建筑物装甲模块基础伤害均为（200），击中三角装甲模块的基础伤害为（300）；\n2.工程机器人可以搬运并兑换（矿石），以换取金币。矿石共有两种：（银矿石），金矿石。工程在兑换站兑换矿石，选择兑换难度不一样，所获金币也不一样，难度越高，金币也就（越多）。同难度下：（金矿）金币获取数高于（银矿）。比赛开始时，双方各有 （400）初始金币，之后每隔 1分钟增加 （50）金币，直到比赛开始 5分钟后结束。比赛开始 6分钟后，双方可再次获得 （150）金币。金币可以用于兑换空中支援、17mm/42mm允许发弹量、远程回血、立即复活。 1枚17mm弹丸所需金币（1），1枚42mm弹丸所需金币为（15）。\n3.步兵机器人可以发射 （17mm） 弹丸，其弹丸击打机器人装甲模块时，基础伤害量为（10）。\n4.空中机器人可发起（空中支援），发射（17mm）小弹丸，在空中支援时间内，空中机器人将获得第一视角画面和 （500发）允许发弹量。\n5.哨兵机器人需全自动运行，可以发射（17mm）弹丸。\n6.地面机器人：包括（英雄机器人）、（工程机器人）、（步兵机器人）、（哨兵机器人）。\n7.三分钟准备阶段开始后，步兵机器人和英雄机器人的操作手可选择机器人的底盘和发射机构类型。七分钟比赛阶段开始后且机器人底盘和发射机构类型选择完毕后，整局比赛期间不可更换。英雄机器人可选择的底盘类型为（功率优先 ）以及（血量优先 ），步兵可选择的底盘类型为：（功率优先），（血量优先），发射机构类型为（爆发优先），（冷却优先）。\n8.飞镖：每局比赛中，飞镖系统可装载 （4）枚飞镖。每局比赛开始 30秒后，飞镖发射站闸门有 （2）次开启机会，云台手可自行选择时间使用。击打基地飞镖检测模块，如选择固定靶伤害为（1000），选择随机靶，伤害为（1200）；击打前哨站飞镖检测模块时，伤害为（750）。\n9.出现以下情况，射击初速度超限，枪口热量超限，底盘功率超限，攻击伤害或撞击，裁判系统重要模块离线，机器人异常离线，地面机器人会（扣血）。\n10.步兵，哨兵，英雄存在枪口热量机制，每检测到一发弹丸，当前枪口热量 增加，其与弹丸初速度无关，枪口热量按 （10hz） 的频率结算冷却。\n11.地面机器人： 占领己方补血点时，将获得每秒上限血量 10%的（回血）增益。\n12.战亡的机器人可以通过完成复活读条复活，或在复活读条进行过程中通过（金币）兑换立即复活。\n13.机器人可通过弹丸击打的方式激活能量机关。红方队伍仅可激活红方能量机关，蓝方队伍仅可激活蓝方能量机关。双方可同时击打能量机关。能量机关分为两个阶段：（小能量机关）和（大能量机关）。成功激活小能量机关时，该方所有机器人获得 25%的（防御增益），成功激活大能量机关时，该方机器人获得相应的（攻击）和（防御）增益；\n\n小能量机关正在被（激活）；\n激活过程中，若出现以下任意一种情况，则此次激活失败，能量机关重置正在激活状态： \n 未能在 2.5 秒内击中随机点亮的装甲模块 \n 击中非随机点亮的装甲模块 \n二．场地相关：\n\n\n\n1.笔试过程中，会给出该图，并且从中挑选个别位置询问其是什么。\n如：会提问：2号位置在赛场上被叫做（补给区）。\n2.基地血量为（5000），前哨站血量为（1500）。 比赛开始时，基地与哨兵机器人处于（无敌）状态。 当一方前哨站被击毁，该方哨兵机器人和基地的无敌状态（解除）。 \n在前哨站被击毁的情况下，从哨兵机器人离开哨兵巡逻区超过一定时间，哨兵机器人未上场、 被罚下或首次战亡，则该方基地护甲（展开）。若哨兵机器人战亡或被罚下，该方基地维持无敌状态。 在前哨站未被击毁的情况下，前哨站的飞镖引导灯常亮，基地的飞镖引导灯熄灭；前哨站被击毁时，前哨站的飞镖引导灯（熄灭），基地的飞镖引导灯（点亮）。 \n2.飞镖发射站是（飞镖）系统的唯一放置区。\n3.比赛开始前，空中机器人需放置于(停机坪)平台上，其投影需在停机坪平面范围内，并按照要求连接安全绳。\n4.雷达基座是用于放置（雷达传感器），上端为面积 1.2m*1.2m 的平台，材质为铁质板材可被磁铁吸附。\n5.补给区是机器人进行（弹丸补给）和（血量恢复）的重要区域。补给区包含补给站、补血点。（补给站）是在比赛过程中提供 17mm 弹丸的装置，包含出弹口、辅助对位的十字激光灯、摄像头和显示屏。（补给区）设有补血点，均铺设了场地交互模块卡，同时面向补给站设置有金属材质的视觉标签。\n6.兑换区是工程机器人兑换（矿石）的区域。工程机器人可在兑换站将矿石兑换成金币。\n7.高地是战场中高于战场地面的部分区域，红蓝双方半场各 3 个高地，将战场划分为多个区域，在空间上形 成立体战场。红方高地包括 R3 梯形高地、R4 梯形高地和 R2 环形高地，蓝方高地包括 B'),(208,'马健博','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727081722369_3661415795.jpg','男','黑龙江省鸡西市','前卫南区','2024','材料科学与工程','材料物理','20240110034','1832746496','13664678617','1832746496@qq.com','电控组',1,'机械组',1,'已通过面试','已通过面试','已通过面试','已通过面试'),(209,'宋晓星','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727081614725_7959383753.jpg','男','山东省海阳县','前卫南区','2024','地球科学学院','地质学','22240610','3025338930','13500937244','3025338930@qq.com','AI组',1,'软件组',0,'我是宋晓星,目前的专业是地质大类.在来到吉林大学之前,接触过一些编程语言(如python与js)和软件开发,有一定的独立解决问题的能力,也有团体沟通协作的经历. 但我不得不承认,此前的经历并非系统性工作,AI是我没有涉足过的领域,但我对着这些技术充满着热情与好奇,希望能在融入吉甲的过程过逐步丰富自己的经历,提高自己的编程能力,不断突破自我,成为合格的吉甲队员.\n','我希望加入吉甲大师的RoboMaster比赛队伍，主要是因为我对机器人技术和人工智能的浓厚兴趣。RoboMaster比赛不仅是一个展示技术和创新的平台，更是一个锻炼团队协作和解决实际问题能力的机会。我坚信，通过参与这个项目，我能够将自己的编程技能与团队的目标结合起来，为团队贡献力量，同时也能在实践中提升自己的能力。','我的短期目标是快速掌握人工智能的基本知识，并能够在团队项目中独立承担相关的开发任务。长期来看，我希望能够在RoboMaster比赛中与团队一起取得优异的成绩，并为团队的技术创新贡献自己的力量。我坚信，只有通过不懈的努力和坚持，才能实现自己的目标。','我虽然并未加入吉甲,但在宣讲当中,我体会到吉甲大师是一支充满活力和创新精神的团队，我相信在这样的团队定能取得优异的成绩和丰富的经历.我对这个团队充满这期待,我相信,在这样的团队中,我能够充分锻炼和成长,和大家一起迎接挑战,共创辉煌.'),(210,'原国伟','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727082126835_3763515653.jpg','男','山西省阳城县','前卫南区','2024','电子科学与工程学院','电子信息类','19240213','783643575','18235691209','783643575@qq.com','电控组',1,'机械组',2,'已提前面试','热爱，学习技能','学习专业知识，c语言 单片机','牛'),(211,'袁晨淇','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727082181657_8609566533.jpg','男','河北省承德市','南湖校区','2024','通信工程','通信工程','20241313','1594473913','18831412616','drlingko@foxmail.com','电控组',1,'AI组',0,'袁晨淇，来自河北省承德市，对于编程、计算机有兴趣，曾经接触过C、python、51单片机（提前批面试已通过）','对机甲大师比赛比较有兴趣、喜欢计算机、编程','精通C语言、单片机相关知识，培养团队合作能力。','吉甲大师成立于2018年12月，参加Robomaster和其他竞赛，项目式培养学生的各项能力。队员需要具备热爱、极致、认真、专一的品质，队伍的口号是：凝聚，齐心协力！突破，永无止境！'),(212,'叶天颖','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727082191906_8570259848.jpg','女','四川省达州市','前卫南区','2024','仪器科学与电气工程学院','仪器类','65240405','486367768','15775674481','486367768@qq.com','电控组',1,'机械组',2,'我是仪电学院的大一新生，来自四川，今年17岁，平常喜欢观看RoboMaster机甲大师比赛。','我对RoboMaster机甲大师赛事有浓厚的兴趣，对吉甲大师社团和Tars_go战队都有相应的了解和兴趣，同时我的专业和要学习的技能相辅相成，能帮助我在机甲大师和学业的道路上越走越远。','期待收获：有机会参与到RoboMaster机甲大师赛、中国计算机设计大赛、挑战杯等多项竞赛，为自己积攒丰富的经验。\n目标：1、 学习并编写嵌入式系统，稳定有效地实现各个模块和组件的基本功能。\n2、 了解并学习各个机器人的硬件系统，设计和布置包括电路板、电子线路的硬件系统，保证机器人整体安全稳定地运行。3、 开发并部署与信号处理和控制相关的算法，完善和优化机器人控制系统。','加入吉甲大师后，通过参加竞赛、设计研发产业需求的产品，不仅项目式地培养了学生的工程实践能力，锻炼了学生追求极致、勇干创新的专业能力，强化了学生遵从本心、服务社会的内驱力和执行力，具有了责任心和全局观的团队精神等素质，让心杯梦想的人创造价值。'),(213,'张梦然','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727083229272_3530279026.jpeg','女','河北省唐山市','南湖校区','2024','通信工程学院','通信工程','20242007','3119232895','15590505369','3119232895@qq.com','电控组',1,'AI组',0,'我叫张梦然，是通信工程学院通信工程专业2024级新生，来自河北唐山，喜欢书法绘画，是一个i 人中的e人，性格沉稳，上进心较强','我觉得这个队伍研究和学习的内容和我的专业一定的相关性，同时我对这些内容也有较高的兴趣，我觉得学长学姐们也都很优秀，希望可以跟着大家学习，锻炼提升自己','希望可以通过加入吉甲大师来提升自己的能力，拓展自己的能力范围，接触更多优秀的同学，近期目标是能够留下来','我觉得吉甲大师是一个优秀的队伍，一个由热爱和坚持支撑起来的队伍，同时对于我来说也是一个平台，一个机会'),(214,'王一晟','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727083888961_7406866180.jpg','男','陕西省渭南市','南岭校区','2024','通信工程学院','自动化','20240122','2972298566','15929758290','wys206123@163.com','电控组',2,'机械组',2,'你好','非常喜爱','再进一步','了解很多'),(215,'刘奕澎','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727084104033_6419393914.jpg','男','吉林省公主岭市刘家炉一组','南岭校区','2024','交通学院','交通运输','17240126','30137975','18604318019','30137975@qq.com','运营组',1,'AI组',0,'我的学习能力比较强，并且擅长人际交往，平时喜欢打各种电脑游戏，对于pc的使用有一定的基础','想要充实自己的大学生活，提升自己的各方面素养，掌握更多实用的能力','学到实用的能力，收获荣誉，充实自己','一个多学科交叉融合，涉及各方面素养的大赛'),(216,'陆广鹏','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727084281971_5900357974.jpg','男','广西贵港','南湖校区','2024','通信工程学院','信息工程','20241214','3137005026','17804318489','3137005026@qq.com','电控组',1,'机械组',2,'我热爱知识，参加过机器人比赛，对机器人有一定了解，同时对信息技术也有一定的掌握','热爱机器人，想为吉大争光，同时为了自我发展','对信息技术更加精通，对机器人更深的了解','吉甲大师是一个培养吉大学子的优秀平台，在机器人以及国家需求的高薪技术方面做出卓越贡献'),(218,'刘博元','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727084849017_3073943705.jpg','男','江西省赣州市','南湖校区','2024','通信工程学院','通信工程','20242021','2140451420','19379960516','2140451420@qq.com','电控组',1,'AI组',0,'已入','已入','已入','已入'),(219,'毛思