机械组',1,'运营组',0,'大家好，我叫张松，来自河南信阳。自认为为人和善，善于倾听别人的意见和不同的见解。探索心强，对一切事物都怀有很浓的好奇心。善于思考，并且勇于解决问题……','1.对机器人感兴趣\n2.机甲大师的宣传很好\n3.想提升自己的能力\n4.期待自己的大学生活丰富多彩','1.提升自己的团队合作精神\n2.从中学习新的本领\n3.培养解决问题的能力','吉甲大师是由南岭和通信院联手组建的一个面向大学生的社团，主要参加有大疆举办的robotmaster比赛'),(225,'胡鸣远','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727088630487_8399893704.jpg','男','河南省洛阳市洛龙区','南岭校区','2024','通信工程学院','自动化','20240329','2820915720','13333796898','2820915720@qq.com','电控组',1,'机械组',2,'我是自动化专业，电控组是和我的专业比较对口且比较感兴趣领域，我目前在学习C语言，对C语言有了初步的认知，之后会持续跟进学习。（在中秋节时已经通过了电控组面试，现在填表完善信息）','对吉甲大师的比赛内容感兴趣，希望能参加社团来发挥自己的能力，让自己的大学生活更加丰富。','希望能学习和应用知识，结识志同道合的同学，参与到一个项目，提升自己的能力。\n目标是能够参加项目，参与RM比赛，积极地参加比赛。','吉甲大师口号是凝聚，齐心协力！突破，永无止境！队员必备的品质是热爱，极致，认真，专一。视觉组，机械组，电控组，软件组，运营组，AI组各组协调合作，为一个共同目标努力前进，在老师指导下自主完成项目。组员们要投入大量的精力，从基础知识到项目完成发挥自己的能力。'),(226,'马瑞祥','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727088350066_3079651476.jpg','男','河南省洛阳市','南岭校区','2024','机械与航空航天学院','机械工程','14240414','2210054176','17772166562','2210054176@qq.com','机械组',1,'电控组',0,'我本人是一名来自河南省洛阳市的一名新生，在机械与航空航天学院学习机械工程专业，个人在电脑编程方面没有任何经验，但我愿意学习。','对机械方面一直有兴趣，但难以实地接触，希望自己能把握住这个机会去试一下。也是因为我想在这个社团里成长。','拥有将课上知识变为现实产品的能力。希望自己也能组装一个机器。','吉甲大师总部在南湖校区，能力强劲，由6个组别组成，分别为。机械组，电控组，视觉组，AI组,软件组,运营组.各组分工完成。'),(227,'孙雨昕','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727088701660_0183505427.JPG','女','浙江省湖州市','南湖校区','2024','通信工程学院','通信工程','20241609','3229531382','18205728058','3229531382@qq.com','电控组',1,'AI组',0,'虽然我没有编程的基础，但是我喜欢学习探索新事物，对了解学习各种知识技能有很大的热情。我经常会有些可能有些奇怪较真的问题，喜欢跟别人探讨，但是我本人又有些社恐，一开始很难和大家放开交流，希望能更快打开自己，能多和大家交流讨论','想学习新的知识，想把学到的知识真正运用到实际，想在学习的过程中和不同的人交流合作，认识更多的人，想体会因为热爱坚持一件事的感觉','期待能够学到编程等技能，期待能在学习的过程中和大家积极交流合作，期待能在与大家接触、共同学习努力，更深入了解机甲大师这个比赛和吉甲大师这个团队的过程中热爱并坚持自己所做的事','吉甲大师是在学长学姐的热爱与传承，老师的坚持与帮助下不断发展的一个团体，这个团体中有着追求极致，热爱，有责任心的学长学姐和老师，大家都有自己的热爱与坚持，朝着目标不断努力，是一个很有干劲和热情的团体'),(228,'陈紫轩','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727089688043_7839034018.jpg','男','湖南省邵阳市隆回县','南岭校区','2024','通信工程学院','机器人工程','20240411','2627397776','15575585695','2627397776@qq.com','电控组',1,'机械组',2,'我是来自通信工程学院机器人工程的陈紫轩，是一名大一新生，对机器人相关的吉甲大师社团比较感兴趣，责任心强，吃苦耐劳，肯学习钻研。','对robomaster感兴趣','学会电控相关知识技能','吉甲大师是吉林大学的一个跨南湖、南岭、中心校区的综合性极强的机器人社团。通过参加RoboMaster机甲大师赛及其它竞赛，培养学生工程能力以及项目合作能力。'),(229,'谭昊','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727091326032_6053844223.png','男','广东','南湖校区','2023','通信工程','通信工程','20231820','2981882034','18026991718','lacmr@qq.com','软件组',0,'AI组',0,'来自通信工程的大二学生，比较外向开朗、话很多，适应能力还不错 大家说我学新东西比较快，平时比较喜欢看足球篮球赛车这种竞技比赛，缺点可能是比较爱睡觉。','一方面是对计算机或者编程比较感兴趣，觉得可以自己写一个网站、自己设计一些东西很\"cool\"；另一方面是对这样强对抗性比赛的热爱，包含着竞技体育的一种硬碰硬、赛场上竭尽全力战斗的追求。','首先是期待收获知识和接收系统的培训吧；在我心目中吉甲大师是一个有着非常丰厚资源的平台，参与其中可以收获很多前沿的，应用性的，在书本里里学不到的珍贵知识。其次就是期待磨练自己的品质，在不同的工作中训练自己，收获一个更坚韧的自己。最后是希望留下一段大学里的回忆；总是在b站里刷到吉甲大师的剪辑、纪录片，自己也很希望加入其中，希望可以努力学习，争取成为赛场上的一份子。','我觉得吉甲大师是一个带有科研性质的组织，同时又很像是一个战队；一边是在课余时间不断学习和精进各种技能，同时要保证在规则的条框里将性能发挥极限。'),(231,'冯浩然','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727091476544_9544959296.jpg','男','陕西','南岭校区','2024','通信工程学院','空间信息与数字技术','17230713','1746225146','18295130520','fy1746225146@163.com','视觉组',1,'AI组',0,'本人在大学已就读一年，并且凭借努力成功转专业到通信工程学院空间信息与数字技术专业，今年自愿降级补休课程同时申请假如吉甲大师团队，希望可以通过自己的努力成为吉甲大师团队的一份子，为吉大贡献自己的一份力量。加入社团后会更加努力学习c＋＋和OpenCV以及Linux的使用。','憧憬吉甲大师团队，希望自己可以在团队发光发热、为校争光。','期望可以收货学长学姐的认可，为吉甲大师团队做出贡献','战队宣言：凝聚 齐心协力\n        突破 永无止境\n规则：赛制分为红蓝两方，规定时间内摧毁对方基地的队伍获胜（基地摧毁条件：摧毁所有前哨站），若未摧毁根据基地血量高低判断胜负。所有机器人自主研发，职能分为7个兵种，分别是：英雄机器人，工程机器人，步兵机器人，空中机器人，哨兵机器人，飞镖系统，雷达\n背景：吉甲大师有着无数学长学姐留下来的传承，他们就像黑夜里的一盏明灯点亮着我们，我们一代又一代的投入都是为了获得冠军'),(232,'胡俊名','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727093086540_8894915095.jpg','男','江苏徐州','南湖校区','2024','通信工程','信息工程','20240914','2361040308','15252018738','2361040308@qq.com','AI组',1,'软件组',0,'来自江苏省徐州市一名对机甲大师和计算机程序有浓厚热情与兴趣的南湖信息工程专业大一新生，从初中学习开始就对新的知识产生浓厚的兴趣，接触机甲大师后我意识到这也许就是早已在等待着我的，我势必要抓住这次机会，让我在新的知识海洋自由的探索与创新','c++及c语言和python等计算机语言深深吸引住了我，当我第一次看到吉甲工作室和吉甲取得的成就就对tars go战队产生了，渴望成为其中一员，遨游在机器人与计算机的知识海洋，为机甲大师再创新高贡献绵薄之力，并在学习过程当中不断进步，提升自己的认知与能力','能在学习中对计算机编程语言得到较为深刻的自己的理解，并且能对其程序进行比较自如的应用，最重要的是帮助tars go 战队再创新高','通过参加RoboMaster机甲大师赛及其它竞赛，设计研发产业需求的产品，项目式培养学生的工程实践能力，追求极致、勇干创新的专业能力，遵从本心、服务社会的内驱力和执行力，有责任心和全局观的团队精神等素质，让心杯梦想的人创造价值。队员必须具备的四个品质，也是入队考察的必要品质：热爱，极致，认真，专一。队伍口号：凝聚，齐心协力！突破，永无止境'),(233,'袁权','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727093847021_0126111016.JPG','男','湖北省','前卫南区','2024','计算机学院','计算机科学与技术','21240322','2693536740','18872325026','2693536740@qq.com','软件组',1,'AI组',0,'我是袁权，是一名计算机学院的学生。对机器人有一定兴趣和好奇','希望能在实践中提高专业知识','志同道合的朋友，全力以赴的经历和过硬的能力','一个具有丰富经验的年轻而又成熟的团队'),(234,'郑涵予','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727093820568_3769476170.jpg','男','天津','前卫南区','2024','地球科学学院','地质类','22240213','2448922386','15244674674','2448922386@qq.com','AI组',1,'视觉组',1,'热爱物理学，对计算机、人工智能等领域感兴趣，喜欢钻研，CCF非专业软件能力认证提高组二等','提升能力，磨炼自身，拓展社交圈（觉得机器人对战很帅）','熟练掌握C++，Python等语言，人工智能理论，团队协作，迎接挑战。','机甲大师成立于2018年12月，是横跨多校区，多学院的大型组织，由电控，AI，视觉，运营，软件，机械六个组构成，培养学生实践能力，创新精神，责任心，团队观等精神品质。'),(235,'杨言','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727095378866_2022112765.jpg','女','广东','前卫南区','2024','软件学院','软件工程','55240206','1224367152','15992635797','1224367152@qq.com','软件组',0,'AI组',0,'软件工程大一新生，对机甲，对编程有充沛兴趣，有一点编程基础','一样锤炼自身的编程能力，拓展视野，增添大赛经验','期待提升自己的coding能力，为团队在大赛中贡献力量','是一个涵盖多方面技术，跨学科，国际化的实验平台，同时报告创新创业等多种工作。多次在国家级机甲大赛中获得名列前茅的成绩。'),(236,'张茂宇','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727093237169_2471195418.jpg','男','山东省临清市','南岭校区','2024','通信工程学院','自动化','20240323','2409121069','15552194235','2409121069@qq.com','电控组',1,'软件组',0,'  来自山东，喜欢机器，擅长交流，比较e人，','喜爱机甲大师，希望在团队合作中，培养专业知识提升个人技能。','对于专业相关知识技能有更深层次的了解，培养自我的兴趣爱好，探索生命的新体验，新方式。','吉甲大师是吉林大学跨南湖南岭南区三校区的一体化高层次培养、竞赛平台，曾获多项殊荣，培养诸多少年英才，是见证奇迹与热爱的地方。'),(237,'姚嘉敏','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727094961598_1367895478.jpg','女','内蒙古乌兰察布市','南湖校区','2024','通信工程学院','通信工程','20241610','483940072','13354717527','483940072@qq.com','电控组',1,'AI组',0,'我叫姚嘉敏，来自山西，我踏实上进，追求卓越，乐于团队协作，渴望进步，对理工科很感兴趣','想在这里收获更多的技能，遇见更多优秀的人，丰富大学生活','学会编程，掌握电路控制，进步进步进步，成为更好的自己','吉甲大师社团通过开展内容丰富、形式新颖的“吉大双创·赋能行动”系列活动，旨在激发学生对于机器人研发技术的兴趣，锻炼学生动手实践能力，提高学生对科学创新的热爱，培养全方位发展的科创人才。'),(238,'李波','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727097978282_5739261307.jpg','女','山西省大同市','南湖校区','2024','通信工程','通信工程','20241701','754190709','13835255316','754190709@qq.com','电控组',1,'视觉组',1,'竞赛小白','锻炼能力','学到有用的东西','提高学生学习素养的平台'),(239,'王思儒','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727098243694_5363770346.jpg','女','甘肃','南岭校区','2024','机械与航空航天工程','机械工程','14240503','2099716566','13919073162','2099716566@qq.com','机械组',1,'电控组',0,'我是24级机械与航空航天工程学院机械工程专业的王思儒，来自甘肃兰州，我的兴趣爱好十分广泛，也对机器人方面非常感兴趣，有较强的学习能力，很期待加入吉甲大师基地！','我本身对机器人方面十分感兴趣，在观看了比赛视频后被基地机器人的作战模式深深吸引，想要加入基地不断学习机器人的相关知识。','掌握solidworks等专业软件，对机器人机械的设计制造能有一个相对完整的认识和学习','吉甲大师是一个非常优秀的横跨吉林大学三大校区的综合性的平台。通过参加RoboMaster机甲大师赛及其它竞赛，设计研发产业需求的产品，项目式培养学生的工程实践能力，追求极致、勇干创新的专业能力，遵从本心、服务社会的内驱力和执行力，有责任心和全局观的团队精神等素质，给予优秀的人以平台展示和发挥所长'),(240,'韩毓舶','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727098801044_4461321839.jpg','男','吉林省','南湖校区','2023','通信工程学院','信息工程','20231010','114258578','13324444825','114259578@qq.com','电控组',1,'运营组',0,'我是23级信息工程韩毓舶，本人不太善于言辞，沉默少言，希望能进入吉甲学习相关知识','希望能学习相关知识，提升自己，为之后学习打基础，对电赛感兴趣但无从下手','希望能学会编程，能自己造出一些东西，如果可以希望能拿到相关比赛的名次。','对吉甲大师，我认为是一个具有极其强大的机器人研发的团队，队员经验丰富，老师认真负责，获得多次奖项，是一个科技感十足的社团'),(241,'齐玉航','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727099111238_6992096032.jpg','男','山东省临清市','南湖校区','2024','通信工程学院','通信工程','20241316','340443591','13717975307','mk7406mm@163.con','电控组',1,'视觉组',1,'在吉甲相关方面，我对机器人比较感兴趣，有锡焊技能基础，目前已经加入电控纳新群，正在学习C语言编程','我对吉甲大师参加的机器人比赛十分感兴趣，希望能学习比赛用到的各种软硬件技能，也期待与团队一同在机器人比赛中创造辉煌战绩','我希望能在团队任务中增长编程与电路的有关知识，助力学校成绩；和团队一起在比赛中获得名次；获取志愿时长','我已经了解了RM规则，认识了每种机器人的功能特性，观看了吉甲参与的几场精彩比赛，也知道了吉甲的内部分工方式'),(243,'张新媚','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727100848262_7321003035.jpg','女','吉林省榆树市闵家镇娄家村2组','南湖校区','2024','通信工程学院','通信工程专业','20241611','55997266','17367481120','55997266@qq.com','电控组',1,'AI组',0,'我来自河北承德，平时喜欢做衍纸等手工，动手能力比较强，比较耐心细致。因为上学的地方是一个小县城，所以没有过竞赛经验，希望可以在大学有一个锻炼自己的机会。','我对机械和电子等领悟比较感兴趣，喜欢实践和动手操作，希望可以通过这次机会更深入的了解和学习这些技术。','首先，我希望通过加入此社团，能够更深入地了解和学习机械和电子方面的技术，掌握更多的知识和技能。其次，在社团中，希望可以通过参与各种机器人项目的制作和竞赛，将所学的理论知识应用到实践中去。这种实践经历不仅能够提升我的动手能力，还能够培养我的创新思维和解决问题的能力。希望在大学可以通过参与吉甲大师，来挑战自己、获得更多的经验和机会。','吉甲大师是一个非常优秀的研究机器人领域的社团,能很好的培养学生的创新和实践能力'),(244,'吴亚伦','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727101194665_4574717404.jpg','男','江西省南丰县','南岭校区','2024','机械与航空航天工程学院','工业工程','14241014','3303763699','13697947473','3303763699@qq.com','软件组',0,'机械组',1,'对机器人研发有浓厚兴趣\n之前没接触过相关知识\n主要想做软件方面的研究','1.对机器人很感兴趣\n2.之后想转专业到计科或软工方面，能提前学习一些专业知识，打好基础\n3.现在在机械与航空航天工程学院，如果进入机械组，能和所学知识结合起来','1.参与竞赛并取得一定成绩\n2.学到机器人研发方面的知识\n3.为以后的转专业准备或更加了解本专业\n4.加强团队协作能力','原来以为做机器人是为了作创新展示之类的竞赛\n结果发现是RM竞赛\n更喜欢了（'),(245,'农志彬','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727101293095_6949558424.jpg','男','广西大新县','前卫南区','2024','地球科学学院','地质类','22240414','1287989328','15676060758','1287989328@qq.com','电控组',1,'软件组',0,'热爱吉甲大师，热爱编程，热爱学习','提高自我能力','习得C语言、单片机，得奖','成员优秀，获奖很多，在全国享有重要地位，非常厉害的的一个组织'),(247,'覃之蘅','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727143239815_7242065430.jpg','女','广东广州','南湖校区','2024','通信工程学院','信息工程','20241201','2079286255','18138773826','2079286255@qq.com','视觉组',1,'AI组',0,'大家好，我叫覃之蘅，是2024级信息工程新生，来自广东广州。性格开朗上进，做事认真踏实，希望能够成为吉甲大师的一员！','1.第一次认识到机器人比赛，从前没有过，这对我来说是一个很珍贵很重要的机会，希望可以借此挑战自己。这几天看了一些关于rm的比赛，也了解了一些，感觉每一年能借着学长学姐经验，把机器人做得更快更准更灵活并不是一件容易的事情，但是希望能够和大家一起面对困难，付出努力\n2.吉甲大师是一个充满热爱，对机器人各方面都认真极致的团队，我希望能够在团队里找到自己的价值，和大家一起认认真真做一件事，为之付出精益求精，收获幸福与成就感。','收获：和大家一起团队协作的经历与能力 自己的技能水平 一段美好的大学回忆\n目标：提升自己的能力，从而帮助团队变得更好','吉甲大师是围绕robot master比赛和其他项目比赛准备的团队，也是一个给大学生实现自己理想想法的平台，在这里我们可以通过分工合作，团队做事来实现很多单靠自己无法想象的事情，可以让机器人从无到有或是变得更强大。吉甲大师有认真热爱，追求极致的氛围，是做实事的地方，在这里可以踏踏实实付出努力，可以收获成长。'),(249,'孙潇哲','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727150705622_8505708548.jpg','男','吉林省江源县','南岭校区','2024','机械与航空航天工程学院','机械工程','14240526','3982216821','18904308213','sxz0923@outlook.com','机械组',1,'运营组',1,'大一零基础新生','获得实践经验，应用理论知识','做出自己的成果','机械等方面的资深团队'),(250,'王宇晗','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727151805541_3876095133.jpg','男','山东滨州','前卫南区','2024','软件学院','软件工程','55240221','2503116571','19729377577','2503116571@qq.com','AI组',1,'视觉组',0,'肯于吃苦，动手能力极强，乐于钻研，高中曾获得过全国高中机器人大赛国三','想在大学继续追寻机器人的步伐，继续在这一方面学习','继续学习机器人相关方面的知识，同时运用软件知识为贵社团尽自己的一份力量，如果能代表团队参赛我会尽自己最大的努力','一个充满热情，追求极致的团队，在机甲方面具有极强的专业知识'),(251,'刘慧颖','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727160919522_8519217481.jpg','女','广西省桂林市资源县','南湖校区','2024','通信工程学院','信息工程','20241006','2583526149','13471298073','liu7724hy@qq.com','视觉组',1,'电控组',0,'我是来自通信工程学院信息工程专业的24级新生刘慧颖，我性格偏内向但一旦熟悉起来后就会很开朗，我做事沉稳，细心，学习能力我觉得也还是可以的，集体荣誉感强，守规矩，懂礼貌，最后希望我能加入吉甲大师这个大家庭中，和大家相互学习，相互支持','一是看过吉甲大师的相关视频，觉得很热血，也因此产生了浓厚的兴趣；二是为了锻炼自己，提升自己的能力，积攒实践经验；三是行了，在这里能认识更多志同道合的朋友，让大学的生活更加丰富多彩','希望我能丰富自己的专业知识，学习到更多相关的知识，也希望我能加入这个大家庭见证吉甲大师的发展，并看到我们学校在比赛上大展光芒，还希望提升我的社交能力和与同学一起合作的能力。目标是加入到这个大家庭，体会每一次比赛的热血','吉林大学机甲大师创立于2018年，现已发展成一个大型的平台组织，跨越了很多学院。口号是凝聚，齐心协力！突破，永无止境！'),(252,'刘天奇','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727170289238_8231977962.jpg','男','湖北省汉川市','南岭校区','2024','通信工程学院','自动化','20240312','2290648415','15826811937','2290648415@qq.com','电控组',1,'机械组',2,'我来自湖北汉川，吉林大学自动化专业学生，擅长数学物理英语，对机械，自动化有极其强烈的兴趣，也曾读过许多有关机械自动化类的书籍，了解相关知识','对机器人，自动化机器兴趣十分浓烈，并且想通过吉甲大师可以获得竞赛成绩，积累宝贵经验，对自己以后的学业和工作有帮助','期待能够成为吉甲大师的一员，为我在的那个组贡献出自己的力量，争取夺得大赛奖项','吉甲大师是一个平台，可以通过吉甲大师提高自己的科研动手能力，并且能够积累宝贵经验，也可以认识各种各样的同学，拓宽自己的人际关系'),(253,'孙维泽','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727181271369_8805772368.jpg','男','黑龙江哈尔滨','南岭校区','2024','通信工程学院','空间信息与数字技术','81230141','210154347','18646307211','210154347@qq.com','AI组',0,'视觉组',2,'本人是23级转专业到空间信息与数字技术专业的学生，现已降级到24级学习，具有较多时间参加各类比赛。假期参与ican比赛智慧农业赛道，现正在备赛智能车比赛。','希望能在吉甲大师学到关于计算机编程，机器视觉，机器人控制等相关知识，满足自己的兴趣，认识到更多伙伴。','熟练掌握编程，机器人控制，图像处理，机器学习等相关技能，参与rm比赛','吉甲大师是通信学院下主要负责参与ROBOT MASTER的组织，rm概括一下就是自主设计一些机器人按规则进行对抗。另附网上查阅到的资料：\n1. 战队背景：\n    吉甲大师是吉林大学TARS-Go战队的别称。这个战队成立于2018年底，旨在通过参与RoboMaster机甲大师赛来提升学生的技术能力和团队协作能力。\n    战队的名字“TARS-GO”源自《星际穿越》中的机器人TARS，寓意着外在做事沉稳有条，内在思维活跃创新。\n\n2. RoboMaster机甲大师赛：\n    RoboMaster机甲大师赛是由共青团中央、全国学联、深圳市人民政府联合主办，DJI大疆创新发起并承办的机器人赛事。\n    该赛事每年吸引数百所高等院校、近千家高新科技企业以及数以万计的科技爱好者的深度关注和积极参与。\n    吉林大学TARS-Go战队在该赛事中表现出色，曾荣获多项荣誉。\n\n3. 团队特色：\n    战队成员来自不同学院、不同校区，形成了跨校区、跨院系、跨学科、跨专业的团队。\n    战队在机械、电控、视觉、决策等组别的紧密协作下，设计并构建了多台整机，实现了机器人的远程控制及自动射击等功能。\n\n4. 编码规范：\n    吉甲大师（即TARS-Go战队）在电控组编码方面有着严格的规范，包括命名方式、变量命名、函数命名、结构体&枚举命名、宏定义命名、对齐&缩进以及注释等方面的要求。\n\n5. 未来发展：\n    战队将继续围绕“智能机器与系统”，探索多元化、创造性和适应性的交叉学科培养体系，形成跨学科、国际化的新工科开放实验平台。\n    战队还将结合各院系、各专业特点，创新地将顶层管理体制设计和学生为主体的运营方式结合，为学生的创意、创新思维提供足够的技术和方向指引。'),(254,'周逸轩','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727182334776_1885269045.jpeg','男','湖南','南岭校区','2024','材料科学与工程学院','材料类','16240919','3148269952','18122891373','3148269952@qq.com','机械组',1,'电控组',1,'我比较喜欢去建模，去把自己的想法实现出来。我高中参加过robomaster的比赛，和另外一哥们一起负责工程机器人的改装。我当时想了很多种方案并进行尝试。最后工程机器人改动了很多也比较完善，拿下了五十秒内完成从基地到资源岛取下六瓶弹药瓶再返回补给区把弹药瓶放到指定平台上的成绩。我没什么东西可以拿来吹牛逼的，编程不太会，soliworks会一些，优点就是想法比较多，可以和战友们交流交流想法，我还挺喜欢这种思维的碰撞的。我也希望通过这个机会学到更多东西，交更多的朋友。','因为热爱，也想学到更多东西，交更多的朋友。','学到一些技术与知识，交一些朋友','有时候操作和战术比改装与程序还有用（泪）高中就是这样被别人打下来了'),(256,'李思澄','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727183298633_8453083777.jpg','男','广西','前卫南区','2024','软件学院','软件工程','55240113','3535296517@qq.com','15778250948','3535296517@qq.com','软件组',1,'AI组',0,'我是一个很好相处，热爱编程的人，期待能加入吉甲大师一起努力','热爱编程，期待能学习编程知识与进行自我实践','能进行自我实践，难铜守银摄金','机甲的魅力，随时可以冲破那一层厚重的铁甲，快速俘获我的内心，软件组虽然不直接参赛，但对于我这种基础薄弱的也有机会进入学习'),(257,'马昕辰','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727188094821_7508500176.jpg','男','浙江省台州市','前卫南区','2024','电院','集成电路','19241528','2561224289','17857511171','2561224289@qq.com','电控组',1,'软件组',0,'会一点python，c，c++，会焊接电路板，会三极管，比较器，555等的大一萌新','比赛很有意思，交友','打国赛，对实际的编程和电路设计有新的突破','多次登上国赛舞台，实力强劲，团队配合好'),(258,'庞念哲','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727190620352_4835561527.jpg','男','山东禹城','南岭校区','2024','汽车工程学院','工业设计','15240913','2578046288','18714647376','18646440676@139.com','机械组',1,'电控组',0,'我叫庞念哲来自黑龙江省 喜欢下棋 打游戏 看书 喜欢机械人相关的内容 所以希望加入战队','对机器人感兴趣 之前了解机甲大师比赛 实验观看了咱们学校战队的视频 觉得非常厉害 希望能成为团队的一名队员 为咱们学校机甲大师战队大赛贡献自己的力量 同时也希望通过在比赛的过程中学习技能 用自己的专业知识来为比赛做出贡献','在机械组贡献自己的力量 学习了解机器人相关知识 了解机器人结构设计 希望学会运用机器相关软件 同时结交志同道合的朋友 \n希望在新的一年的比赛中机甲大师比赛取得优秀名次作出贡献 希望多参与机械组的结构设计过程','我眼中的吉甲大师是由一群志同道合的同学组成的实力强大的战队 在往年的全国赛中 获得了很好的名次 击败了西北工业大学等实力强大的高校 有优秀教师带领 有优秀的学长学姐指导'),(259,'李壁宇','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727231141298_4168787543.jpg','男','陕西','南岭校区','2024','机械与航空航天工程学院','机械工程','14240428','2157066891','13186330323','2157066891@qq.com','机械组',1,'电控组',1,'我是一名热情开朗，有钻研精神的学生，对机械组装，研发十分感兴趣。对吉甲大师团队充满向往。高中学习期间，对pathon编程有简单学习，对机器人组装，传感器的组装有一定了解。高中时期做过自动浇花机，有一定项目设计，机械组装经验。','了解了机甲大师比赛后，对比赛非常向往，希望能够锻炼自身能力。同时从小就对机械组装设计方面比较感兴趣，希望大学能延续热爱。','提高自身能力，加深对于机械，软件方面的认知。希望能参加机甲大师的比赛拓展眼界。','已经了解了基本赛制和比赛部分细节，了解了各个部门的分工和方向'),(260,'王一州','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727235977759_9043695770.jpg','男','山东临沂','前卫南区','2024','计算机科学与技术学院','唐敖庆计算机','21240323','3947372379','17867191635','3947372379@qq.com','软件组',1,'AI组',1,'1.性格较为外向 有较强的沟通能力与协调能力\n2.专业相对口 并通过选拔进入了理科实验班（唐敖庆 计算机）\n3.对机器人类的事物感兴趣','1.对于机器人 人工智能这些方面较为感兴趣\n2.想要锻炼自己的能力 综合发展\n3.专业相对口 希望能为吉甲大师作出一些贡献和帮助','1.锻炼自己的能力\n2.在比赛中取得较为优异的成绩（前提是成功入队）','吉甲大师是一个充满趣味与挑战的社团 在机器人类比赛方面有着突出的实力 多彩的活动能够丰富我们的大学生活 充满挑战的比赛也能锻炼我们的综合能力'),(261,'姜鸿鑫','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727245991443_9100748981.jpg','男','吉林集安','南岭校区','2024','汽车工程学院','能源与动力工程','15241409','2097994673','13353159661','2097994673@qq.com','机械组',1,'视觉组',0,'有良好的自学能力，善于沟通，不怕吃苦，渴望学到有用的知识。','对机器人很感兴趣，想要参加RM并能贡献自己一份力量。同时从中学到一些专业技能','收货一群志同道合的好朋友，认识优秀的同伴。学习专业的知识，提高自己的动手实践能力。','这是一支兼具实力与激情的队伍，我很懊悔现在才了解。在我补看了之前的比赛视频后，我看到了队员们之间的团结合作，落后时的冷静，看到了他们的热情，这种激情也在激发着我加入吉甲。今年首次闯入全国赛让我也振奋不已，我也十分渴望能够参与其中再和吉甲闯入全国赛。'),(262,'范艺馨','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727251301114_9724856116.jpg','女','辽宁省营口市','前卫南区','2024','材料科学与工程学院','材料物理','16240103','2593533289','15541733933','2593533289@qq.com','电控组',1,'机械组',1,'大家好！我叫范艺馨。非常荣幸能够有机会加入吉甲大师社团。虽然所学专业与我的兴趣爱好有些偏差，但我对机器人一直有着浓厚的兴趣和热情。在日常生活中，我积极探索这个领域，不断学习和提升自己的知识与技能，我有团队合作能力、创新思维，相信这些特质能够为社团的发展贡献一份力量。我也渴望在社团中结交志同道合的朋友，共同交流、共同进步。我期待着与大家一起在吉甲大师社团中创造出更多的精彩，共同为实现社团的目标而努力','是自己对于机器人设计的兴趣和热爱，对吉甲大师社团氛围的向往','我相信加入社团后，我能够接触到更多前沿的知识和技术，拓宽自己的视野，进一步提升自己在机器人设计的能力。其次，我十分注重团队合作和交流。吉甲大师社团为成员们提供了一个良好的平台，让大家可以相互学习、相互启发。我期待着能与志同道合的伙伴们一起探讨问题、共同攻克难题，在团队的协作中实现个人的成长。','我认为吉甲大师社团是一个充满活力与创造力的团体。它汇聚了众多对机器人设计有着深厚热爱和追求的伙伴们。在这里，大家共同探索、共同进步，为了推动吉甲大师夺得更多荣誉而不懈努力。 社团不仅有着专业的氛围，让成员们能够在其中不断提升自己的知识与技能，还充满了温暖的团队情谊，大家相互支持、相互鼓励。我对这样的社团氛围深感向往。\n '),(263,'吕佳琦','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727260927179_5798104191.jpg','女','山西省大同市','南岭校区','2024','机械与航空航天工程','机械工程','14240199','1669748763','15234325112','1669748763@qq.com','机械组',1,'运营组',1,'我叫吕佳琦，来自机械与航空航天工程学院24级机械工程专业平时喜欢看书、绘画，性格安静、沉稳 。\n虽然在机甲缺乏经验，但我想不断挑战自己、完善自己、努力成就更好。','1.个人兴趣:可以让我在自己感兴趣的领域深入探索，发展个人爱好\n2.能力提升: 我可以向学长学姐学习，这有助于提升你的专业能力\n3.团队协作:社团活动通常是集体活动，这要求成员之间必须相互协作，考虑他人和集体的利益，通过参与，可以培养团队精神和团队协作意识。','可以把书本上的知识切实应用到比赛中，参与机器人的测试和创新设计。','由通信、机械、计算机、软件多个学院的机械爱好者构成。包含机械设计，电机控制视觉识别等分工。现已发展成为吉林大学一个跨南湖、南岭、中心校区的综合性极强的大型平台组织。成员横跨文、理、工、管多学院。'),(264,'郭晓萌','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727274638411_2359487704.jpg','女','河北省定州市','南岭校区','2024','通信工程学院','自动化','20240103','3233428078','15849234906','gxm3233428078@qq.com','AI组',0,'软件组',0,'我是郭晓萌，在读于通信工程自动化专业大一。本人性格较为开朗，团队合作能力强，善于沟通。性格严谨，热爱学习探索新事物，爱好广泛，旅游打游戏看书，动漫数学ai相关。','对这个社团的活动和所研究的内容十分感兴趣，非常希望和其他志同道合的同学一起参与，共同学习，提升我个人的综合素质。这也是一次对我很好的锻炼机会，能帮助我提高软件，机械等方面的技能。在公众号文章和视频里了解吉甲大师，我感觉这是一个氛围很好的部门！期待在这里交到一些志同道合的好朋友并一起进步，大家一起将吉甲大师建设的越来越好！','期待在这里锻炼自己的团队合作，沟通，学习等能力，拓展视野，学习更多方面的内容，提升自身的综合素质，丰富个人生活。交到一些志同道合的好朋友大家一起进步。至于目标，希望能成功进入全国赛并和团队协作拿到一二等奖。','吉甲大师参加RoboMaster机甲大师和其他竞赛，设计研发其产品，项目式培养学生专业能力。技术组包含电控，视觉，ai，机械，运营，软件等组。吉甲大师的队员具有热爱，极致，认真，专一等必要品质，以：凝聚，齐心协力！突破，永无止境！为口号。在2024年比赛中进入全国赛。'),(265,'王忠奇','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727268669785_4946996024.jpg','男','湖北武汉','前卫南区','2024','计算机科学与技术学院','理科试验班（计算机，唐敖庆班）','20241520','2868116803','17786516305','2868116803@前','视觉组',1,'AI组',0,'掌握初级c++\n学习过python基本语法，html\n了解过深度学习\n了解过神经卷积网络\n有较强的自我学习能力以及热情','觉得robomaster赛事非常有趣，渴望能够参加\n希望能够团体合作，为了共同的目标努力\n希望能够提升自己的专业素养，学习多种开发方式，丰富自己的素养\n','学习python，深度学习，神经卷积，js以及其他多样的开发工具\n积累团队合作以及项目开发的经验\n能够一起获得rm赛事的名次','一个涵盖了很多方面专业知识的赛事平台，可以丰富专业技能，同时能够学习团队协作\n指导老师很和蔼，同学友善，氛围好\n'),(266,'赵智诚','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727279538282_9055447746.jpg','男','吉林省柳河县','前卫南区','2024','仪电学院','电气工程及其自动化','65240123','1011559606','17622623921','1011559606@qq.com','电控组',1,'AI组',0,'仪电大一新生，不太懂，但是可以花时间去学','对此比赛感兴趣，并且愿意去学校更多知识','希望学习更多有用的新知识，并且在比赛过程中增强团队协作能力和社交能力','一个很好的活动'),(267,'沈东升','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727310366558_7329615010.jpg','男','黑龙江','前卫南区','2024','电子科学与工程学院','电子信息类','19240216','3599578227','18846532722','a5636942@163.com','电控组',1,'视觉组',0,'有一定的团队合作能力 善于学习沟通 虚心认真 ','对机甲大师有较为浓厚的兴趣 希望能看到自己的所学可视化','linux系统的基本使用和掌握 c c++等编程语言的熟练精通','吉甲大师是吉林大学参与机甲大师的队伍 又称TARS-Go'),(268,'常哲语','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727312231525_9317405918.jpg','女','河南省安阳市','南岭校区','2024','通信工程学院','空间信息与数字技术','20240605','1448703172','17525775903','1448703172@qq.com','AI组',0,'软件组',0,'我叫常哲语，来自河南省安阳市，mbti是intj，会打乒乓球羽毛球和排球，兴趣爱好是钢琴，喜欢看一些科幻类和悬疑刑侦类的书，最喜欢的书是三体和福尔摩斯探案集，很喜欢里面的罗辑和章北海，最喜欢的学科是物理。','比较喜欢物理，所以对机器人很感兴趣，到吉甲大师可以认识一群志同道合的朋友，并且一个团队齐心协力完成一个共同的目标也让我觉得很刺激。并且我认为吉甲大师是一个很好的平台，在那里我能够获得能力的提升，学到更多新的有意思的知识。','获得更多和机器人有关的知识与经验，培养自己的技能和思考能力，更重要的是获得一段在团队中与大家共同努力的珍贵美好回忆。','吉甲大师是一个很好的平台，能够使有此兴趣的同学在此获得更多的知识，提升自己的能力。同时，吉甲大师还是一个优秀团结的团队，同学们为了一个共同的爱好与志向在此相聚，共同进步共同努力。'),(269,'李佳微','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727315962065_1030525254.j