'电子科学与工程学院','电子信息类','19240725','2997380051','18343240069','2997380051qq.com','机械组',1,'AI组',0,'本人十分热爱机器人，从小玩乐高机械组，希望学习现实生活中的机械知识。并且因为专业是电子信息，也希望可以在接近的领域有所建树。本人踏实肯干，创新能力强，有丰富的想象力和艺术设计能力，认真负责，是那种为了一个作品可以不吃不喝一天都死扣的人。希望能为吉甲大师贡献自己的力量，在大赛上为校争光，同时运用所学到的知识，在机器人竞赛上得到好成绩！','学习机械知识，希望能为吉甲大师贡献自己的力量，在大赛上为校争光，同时运用所学到的知识，在机器人竞赛上得到好成绩！','学习机械知识，在电子信息相似领域有所建树，进而参加机器人竞赛，夺得奖项。研究生希望研究跟机械有关的专业领域，自主研发，为校争光','初步了解，就深深爱上了。之前也看过机甲大赛，热爱机器人的很大原因就是这种大赛带给我的震撼和惊喜'),(277,'康鑫宇','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727348955388_1457507249.jpg','男','河北石家庄','南湖校区','2024','通信工程学院','通信工程专业','20241816','2584781770','18132670313','2584781770@qq.com','电控组',1,'软件组',0,'通信工程学院新生','对机器人的兴趣和对专业知识的渴望','专业知识以及实践经验','是一支综合实力较强的参赛队伍'),(278,'吴泱毅','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727349150747_0267333983.jpg','男','广东','南湖校区','2024','通信工程学院','通信工程','20241818','1339502981','15218414929','1339502981@qq.com','视觉组',0,'软件组',0,'学习过一点c++内容，对电脑操控较为熟悉，为人富有责任感','对大学社团活动和吉甲大师感兴趣','学习到丰富的专业知识和能力','对robotmaster赛事有基础了解'),(279,'霍行建','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727348523090_3604632096.jpg','男','山东省枣庄市','前卫南区','2024','商学与管理学院','物流-计算机','35241918','3682521670','17843092883','17843092883@163.com','软件组',2,'视觉组',0,'姓霍，名行建，取自“天行健，君子以自强不息”，字振东，寓意振国强东。兴趣爱好和特长均为计算机，了解软硬件结构，熟悉计算机基础运维，精通各种office，对人工智能情有独钟。','兴趣驱使。以前报过乐高机器人兴趣课，了解过机器人大赛，一直对此抱有浓厚的兴趣，希望得到一个真正参与到其中的机会。也希望学到更多计算机相关知识。','深入学习前后端开发，各种编程语言，计算机视觉，人工智能等','机甲大师赛是由大疆发起并承办的机器人赛事，吉甲大师TARS-GO战队曾屡获佳绩。TARS-GO取名自《星际穿越》中的机器人TARS，寓意“外在做事沉稳有条，内在思维活跃创新”，战队口号是\"凝聚，齐心协力；突破，永无止境“这也很符合我的学习理念。吉甲大师不对专业设限，任何专业的同学都可报名，都可在其中取得一席之地，战队结构完整，模块丰富。于广大希望、敢于、勇于挑战自我的同学，吉甲大师是一个优质的创新平台'),(280,'王梓名','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727350493967_9525709058.jpg','男','甘肃省白银市','前卫南区','2024','电子科学工程学院','电子信息','19240711','236907014','13830056096','236907014@qq.com','运营组',1,'机械组',2,'我叫王梓名，是一名电子科学与工程学院的新生，今年17岁，我的爱好比较广泛，但对于机械，战术和机器人等知识独有情钟，我从小就喜欢专业一些军事知识，并且在初三时就观看每一届机甲大师大赛的直播。','我从小就喜欢用积木和乐高拼搭一些机械结构和机器人模型，并且和朋友们模拟机器人对战。我在初三时第1次了解到机甲大师，而在高二时，我以吉林大学为自己的高考目标，从那时起就开始关注吉甲大师社团，比赛中机器人精妙的结构和神奇的创新都令我感叹并深深的吸引着我，让我渴望成为吉甲大师的一员','我希望能够学习到更多的软件，机械和机器人知识，并成为吉甲大师一员，进而参加全国机甲大师大赛，为我校争夺更多的荣誉，打响吉甲大师社团的名声，让我校学生自主研发创新的机器人走向全国','我对吉甲大师的了解源于全国机甲大师大赛，我知道我校Tars go战队曾获得了2020年机甲大师全国赛一等奖，在2021年获得机甲大师全国赛三等奖，2022年获得空中机器人二等奖和工程机器人二等奖，在今年也获得了三等奖'),(281,'李梦雯','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727359482022_5372729643.jpg','女','河南省安阳市','南湖校区','2024','通信工程学院','通信工程','20241303','3115494136','13639617910','3115494136@qq.com','软件组',0,'电控组',1,'我性格活泼开朗，乐意接受别人意见，高中接触过C++语言和Python语言，乐于学习。','希望能在吉甲大师中接触更多知识途径，认识更多志同道合的伙伴，不断学习提升自己。','希望能了解更多相关知识，找到志同道合的伙伴，不断提升自己。','枕戈坐甲，奋勇前行，吉甲大师是吉林大学跨校区，跨专业招收成员的组织，具有优良的传承和氛围，需要老师和同学们共同的坚持，荣获多项奖项。'),(282,'王梓璐','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727362070300_0803924079.jpg','男','山西太原','南岭校区','2024','生物与农业工程学院','农业机械化及其自动化','18240323','2091779768','17309583229','2091779768@qq.com','机械组',1,'电控组',0,'我从小对DIY有一股难以言喻的向往。从游戏开始，第一间小房子，第一条生产线，第一个伟大工程，到现实生活中的一件小手工，组配的第一台电脑，DIY的第一个生活用品。当我看到机甲大师大赛时，各式各样的机器人迷花了我的眼，我第一次了解到一个团队能具有多么大的能量，每个成员各司其职，在大赛里创造独属于自己的时刻。在吉林大学这个大家庭里，我居然发现我也可能有机会为一台充满科幻感的小机器人出一份力，在完全不同的领域中挥洒我的汗水，我希望成为吉甲的一员。','我希望能借助吉甲这个平台提升我的个人能力，改变自己解决问题，思考问题的方式，最重要的是能结交不同的伙伴，在吉大度过一个难忘的青春。','我希望能在吉甲中学会一些机械结构上的知识，学习各个队伍大佬的经验并掌握，最终为吉甲贡献属于自己的一份力量。','有很负责的指导教师，能够给大家引领方向，也有许多厉害的学长学姐，可以在电路，AI，软件,机械等各个领域给我们传授知识。'),(283,'祝一睿','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727371837685_9147952548.jpg','女','湖北省武汉市','南湖校区','2024','通信工程学院','通信工程','20241905','1316179289','17311183308','tudouni17@126.com','软件组',0,'视觉组',0,'大概是对对未知的东西有比较强烈的好奇心的人\n*想学的东西一定会努力去学的人','感兴趣','学到东西，提升综合学习能力','觉得是很需要团队交流的社团\n是综合性很强、对提升能力也十分有效的社团\n很多人梦想创造自己价值的地方*'),(284,'丁怡淳','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727414249775_2503231326.jpeg','女','河南省驻马店市','南岭校区','2024','机械与航空航天工程','工业工程','14241002','2130405310','15839608697','2130405310@qq.com','机械组',1,'视觉组',0,'我是丁怡淳，一名ENTJ。\nE是effective,我永远充满效率。\nN是nice,be nice是我的目标。\nT是talented,我将激发我的所有潜能。\nJ是justice,我会永远高举赛场荣耀。\n我希望能为吉甲贡献自己的力量，所以我来到这里来推荐我自己。','我一直迷恋在极限边缘的疯狂感，享受碰撞的刺激。从小就是f1迷的我，在初中时了解到了rm，之后看了浙大在一场比赛中打镖的完美发挥而深深陷入rm的魅力中。我无比希望自己能参与到这项运动中来，感受埋头苦干的滋味，浅尝机器的魅力，所以我写下了这篇介绍信。','培养我的专业技能，拓展视野与技术，更希望能参与到比赛当中去','来到这个学校就了解到本校的吉甲大师，就想着参与到其中来'),(285,'陆大哲','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727418598848_3324511719.jpg','男','南宁市武鸣区','前卫南区','2024','地球探测科学与技术学院','勘查技术与工程','23240214','1142107205','13457144316','1142107205@qq.com','机械组',1,'视觉组',0,'我叫陆大哲，广西老表。','本身对机械类的东西比较感兴趣','希望能积累到相关的机械，电子知识','第一次听说QAQ'),(286,'余行之','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727424570020_2776491475.jpg','男','重庆','南岭校区','2024','机械与航空航天学院','机械工程','14240519','2256471461','15013147198','2256471461@qq.com','机械组',1,'电控组',0,'我是余行之，来自机械工程专业。我比较擅长数学、物理等科目，具有较强的数理逻辑能力。同时我也对机械专业有着浓厚的兴趣，因此选择了机械专业。我爱好广泛，包括书法、模型制作、电子游戏等。它们培养了我的动手实践能力，也让我学会了时间管理以平衡学习与兴趣爱好。我希望加入吉甲大师，努力提升自我，为基地贡献自己的力量。','希望将所学知识投入实践，提升自己，参与活动，结交益友，丰富大学生活。','提升实践能力，与优秀的同学们交流，结交新朋友。','吉甲大师成员众多、各有所长，同时也在各大竞赛中取得过优异的成绩。能为成员提供更多学习与表现自我的机会。'),(287,'夏济河','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727425670150_0651552194.jpg','男','河南省项城市','南岭校区','2024','机械与航空航天工程','机械工程','14240327','2265358470@qq.com','15937188219','2265358470@qq.com','机械组',1,'软件组',0,'我是一个喜欢尝试新事物的人，虽然有些内向，但也很渴望和大家交流。关于机甲大师，虽然我是个了解没多久的小白，但我愿意努力学习，为社团贡献','对于rm比赛很有兴趣，并且想要亲身实践参与其中，借此交到朋友，磨炼自己','希望能够在这里磨炼自己，交到新朋友，度过充实的社团生活。','先前看过rm的比赛，了解一些基础规则和社团内各个部门的职能。实际小白'),(288,'冯洪叡','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727431687809_1759409416.jpg','男','山东省蒙阴县','南湖校区','2024','通信工程学院','信息工程','20240813','1272660525','15604573654','15604573654@163.com','AI组',0,'视觉组',0,'我是一位来自祖国最北方的山沟的小镇青年。平庸且真切。','想尝试一下新事物，本人一直对机器人感兴趣，能有机甲大师这个平台是学校的光荣，我也希望能成为其中的一员，在推动集体不断前进的同时提升自己。','收获相关知识，提升自己的团队协作能力，为集体献力。','不仅是节目上光鲜亮丽的精彩对决，另一面更是背后的团队夜以继日奋斗的成果，是团队精神与奋斗精神的具象化体现。'),(289,'林靖博','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727442625116_3634457967.jpeg','男','吉林省白山市靖宇县','南岭校区','2024','交通学院','交通运输类','17240726','1936607933','13894078692','1936607933@qq.com','机械组',1,'AI组',0,'来自交通学院的林靖博','偶然看到，感觉很有意思，仔细了解后对其很感兴趣','希望能够在吉甲大师这个组织学到东西结交朋友','培养学生实践能力，参加比赛'),(290,'张钦睿','https://tarsgo.xf233.com/tarsgo_cloud_service/upload/Registration/1727448353456_9225088308.jpg','男','河南省通许县','南岭校区','2024','通信工程学院','自动化','20240230','2551667863','13838162521','2551667863@qq.com','电控组',1,'AI组',0,'高中就读于河南省实验中学，现在是吉大自动化专业的大一新生，平时喜欢打羽毛球，跑步，美食，小时候喜欢玩乐高，对机甲大师比赛以及机器人很感兴趣','机甲大师比赛很酷不是吗？','希望能在吉甲大师学到更多专业知识，也提升自我的实践能力和运用能力，收获比赛和科研的经验，在富有激情又充满趣味与收获的比赛中提升自己的综合素质与专业素养','吉甲大师是双创基地，培养目标非常明确，又是综合性的专业融合之地，获得过许多大奖。');
